, Summary = "Report to Mr. Kidd"}
, 
[7028] = {Title = "Pursuing Rayan Moore", 
Description = {"You told Mr. Kidd what you heard in the basement of the empty house near the national border. There will be a serious internal dispute, so this would be the perfect time to raid them."}
, Summary = "Investigate the empty house near the national border"}
, 
[7029] = {Title = "Pursuing Rayan Moore", 
