, 
[7030] = {Title = "Pursuing Rayan Moore", 
Description = {"Mr. Kidd has given you the Bloody Crystal of Darkness as well as a journal. Your last assignment is to bring the journal to Rin"}
, Summary = "Deliver the journal to Rin"}
, 
[7031] = {Title = "Pursuing Rayan Moore", 
Description = {"Rayan has escaped. Or, could it be Satan Morocc who took him? You must give the pattern number of the magic wavelength to Echinacea with the journal."}
