Description = {"I\'ve just run out of feed for Hillslions. Scholars think these guys are members of the cat family. I\'ve been trying to feed them various things.. This time I\'d like to try Monster\'s Feed. Can you please bring me 20 Monster\'s Feed and 30 Pet Food?"}
