, Summary = "Find the traces of Terra."}
, 
[7058] = {Title = "Messenger - Arc\'s Favor", 
Description = {"You fell between giant roots of a tree. You\'ve found a giant tribe called the \'Sapha,\' hard as rocks and big as mountains. Seems like there\'s no more traces left from Terra."}
