, Summary = "Find Terra"}
, 
[7060] = {Title = "Messenger - Terra\'s Whereabouts", 
Description = {"When you arrived to see the Sapha, Terra was already long gone. Very bright pieces of mineral were scattered around the hardened giant. These pieces must be the Bradium."}
