, Summary = ""}
, 
[7190] = {Title = "Information Gathering - at the Guards", 
Description = {"Cat ears? You sure? Are you humans always like that? Why don\'t you just go meet Ahat. He is a very strong Sapha. He may be a Jarute working through piles of documents, but he must be hiding his power!!"}
, Summary = ""}
, 
[7191] = {Title = "Shay\'s designation - BK", 
Description = {"In order to facilitate information gathering, Shay introduced BK from the Cat Hand Merchants. You need to tell BK that ^4d4dff\'Shay\'s special drink will be delivered.\'^000000 if BK doesn\'t offer any help..."}
, Summary = "Meet BK on the outskirts of Kamidal Mountain outside of El Dicastes."}
, 
[7192] = {Title = "BK\'s Information", 
Description = {"According to BK\'s information, the cat ears man is closely related to Ahat, the popular man in El Dicastes. But he says Ahat is not a Sapha and was found near the Rift. What\'s the relation?"}
, Summary = "Discuss your findings with Shay at the Burman Flone"}
, 
[7193] = {Title = "Dimensional Rift Investigation", 
Description = {"After talking to Shay, investigate the area near the Southern Rift to find the truth. Find any clues that may be useful to the investigation."}
, Summary = "Investigate the Dimensional Rift area to the south."}
, 
[7194] = {Title = "What\'s this bloodstain?", 
Description = {"I found blood clotted in the dirt near the Rift. Does this have anything to do with Ahat?"}
, Summary = ""}
, 
[7195] = {Title = "What\'s this skin piece?", 
Description = {"I found a frozen piece of skin from a living thing near the Rift. Does this have anything to do with Ahat?"}
, Summary = ""}
, 
[7196] = {Title = "What\'s this suspicious magic power?", 
Description = {"You found a suspicious magical stone fragment. It feels like the magical power coming from the Rift. Does this have anything to do with Ahat?"}
, Summary = ""}
, 
[7197] = {Title = "Exploit Certifications of Sapha?", 
Description = {"It\'s necessary to bring Exploit Certifications of Sapha to have an audience with Ahat. Carry out some quests throughout the capital to receive certificates."}
, Summary = "Collect 3 Exploit Certifications of Sapha"}
, 
[7198] = {Title = "Audience with Ahat", 
Description = {"You can have an audience with Ahat after paying 3 Exploit Certifications of Sapha. You can meet Ahat after going up to the Administrative Office in Dicastes Diel."}
, Summary = ""}
, 
[7199] = {Title = "Secret Order from Ahat", 
Description = {"Ahat ordered you to remove various traces around the Rift. Collect 10 items each of Clotted Bloodstain, Frozen Piece of Skin, and Strange Magic Stones."}
, Summary = ""}
, 
[7200] = {Title = "Cheshire\'s call", 
Description = {"Do the removal work little by little so that you don\'t arouse any suspicion. Meet with Cheshire at the Administrative Office when it is the proper time."}
, Summary = "Wait for the timer and speak to Cheshire."}
, 
[7201] = {Title = "Removing traces", 
Description = {"Remove traces from the Dimensional Rift around the southeast area of the Kamidal mountain outskirts. As usual, collect 10 items of each of Clotted Bloodstain, Frozen Piece of Skin, and Strange Magic Stones."}
, Summary = ""}
, 
[7202] = {Title = "Secret order from Doha - Collect proof", 
Description = {"Without being noticed by Cheshire and Ahat, hide each Rift trace to submit to Doha as evidence, and put it in the report. Collect 1 Clotted Bloodstain, 1 Frozen Piece of Skin, and 1 Strange Magic Stone."}
, Summary = ""}
, 
[7203] = {Title = "Secret order from Doha - Final Report", 
Description = {"Talked with Jarute, Heslanta about several subjects. After talking with Heslanta, bring your findings in a report to Doha at the Expedition camp."}
, Summary = "Bring your final Report to Inspector Doha"}
, 
[7204] = {Title = "Spring Bringing Flower", 
Description = {"I met \'Bomi\' in Lutie who was curious about Spring bringing flower. For her, I promised I would bring her a bunch of spring flower. It may be enough with 5 Huge Spray Of Flowers.."}
, Summary = "Give Bomi Spring as a gift"}
, 
[7206] = {Title = "The new days of Cheshire", 
Description = {"You will find a member of the Cat Paw if you look in the middle of the ^4d4dffKamidal Tunnel^000000. ^4d4dff On the west side of Skaraba Hall entrance there is a marked box of goods.^000000. Please move it. The location of where you need to move it to will be on the box."}
, Summary = ""}
, 
[7207] = {Title = "Cheshire\'s box", 
Description = {"You found the box that Cheshire was talking about in Kamidal Tunnel. On the bottom side of the box in small letters, it says ^4d4dff In front of Bifrost\'s Rift^000000. Must pass this to Cheshire who can be anywhere in Bifrost."}
, Summary = ""}
, 
[7208] = {Title = "And tomorrow, too, please?", 
Description = {"Agreed to help transport the loaded <NAVI>[box]<INFO>dic_dun01,273,113,0,101,0</INFO></NAVI> to Cheshire once a day to Kamidal Tunnel. When it is time, go get the box."}
, Summary = ""}
, 
[7209] = {Title = "Forget the box.", 
Description = {"The box is lost. Instead of the box, Cheshire is asking you to get 20 Refined Bradium instead of the box."}
, Summary = "Refined Bradium: 20 each."}
, 
[7210] = {Title = "Daily delivery", 
Description = {"Cheshire is waiting for the Bradium box. You must take today\'s items to Cheshire who is waiting in Bifrost."}
, Summary = ""}
, 
[7211] = {Title = "Explore the Hazy Forest", 
Description = {"Explore the Hazy Forest. The Hazy Forest remembers you, so if you try to force reentry, it may reject you."}
, Summary = ""}
, 
[7212] = {Title = "Finding Loki", 
Description = {"By chance, you met someone named Loki in the forest. He is looking for someone. Jarani(name?) with the purple hair. What does this mean? If you discover what it means, should you let Loki know?"}
, Summary = ""}
, 
[7213] = {Title = "Wandering Protector", 
Description = {"Loki was looking for the Guardian of Niddhog who was wandering around the fog aimlessly.  Once out of the forest, we agreed to meet in Mora Village."}
, Summary = ""}
, 
[7214] = {Title = "Advanced Training at Comodo", 
Description = {"Look for the cave located to the north. There\'s someone there named Romeo. You know? As in Romeo, Romeo, wherefore art thou Romeo."}
, Summary = "Find and speak to Romeo"}
, 
[7215] = {Title = "Stalactic Golem Hunt", 
Description = {"There is a cave north of Comodo that has big monsters there. It shouldn\'t be difficult to hunt 3 of them."}
, Summary = "Hunt 3 Stalactic Golems and return to Romeo in Comodo."}
, 
[7216] = {Title = "More Golem Hunting", 
Description = {"Now that you\'ve proven yourself, hunt 10 more Stalactic Golems so that travelers can travel safely through the cave."}
, Summary = "Hunt 10 Stalactic Golems and return to Romeo in Comodo"}
, 
[7217] = {Title = "Field drops", 
Description = {"Instructor Romeo asked you to bring him some materials from hunting Wootans and Dryads in the field north of the Comodo Cave."}
, Summary = "Find 5 Shoulder Protector and 7 Sharp Leaf"}
, 
[7218] = {Title = "Report to Instructor Ur", 
Description = {"Your tasks for Step 1 are over for now, so go back to Eden Group Headquarters and speak to Instructor Ur."}
, Summary = "Report to Instructor Ur back at Eden Group Headquarters"}
, 
[7219] = {Title = "Advanced Training at Glast Heim", 
Description = {"Near Geffen, there is an area known as Glast Heim which is infested with undead and ghost monsters."}
, Summary = "Find and speak to Johan at Glast Heim"}
, 
[7220] = {Title = "Wraith Hunt", 
Description = {"Help clear out the Abbey by hunting the Wraiths inside."}
, Summary = "Hunt 20 Wraiths and return to Johan outside"}
, 
[7221] = {Title = "Evil Druid hunt", 
Description = {"Another problem monster in the Abbey is the Evil Druids. Hunt them inside the Abbey and return to Johan."}
, Summary = "Hunt 10 Evil Druids"}
, 
[7222] = {Title = "Report to Instructor Ur", 
Description = {"Your hunting at Glast Heim has helped clear the Abbey. Return to Eden Group Headquarters and speak to Instructor Ur."}
, Summary = "Report to Instructor Ur back at Eden Group Headquarters"}
, 
[7223] = {Title = "Advaned Training in Einbroch", 
Description = {"The industrial city of Einbroch east of Lighthalzen is where the next training mission is."}
, Summary = "Find the dispatched Instructor Kiren in the field south of Einbroch"}
, 
[7224] = {Title = "Porcellio hunting", 
Description = {"As a warm-up, find and hunt 30 Porcellio monsters crawling around the fields of Einbroch."}
, Summary = "Hunt 30 Porcellios and return to Kiren in the field south of Einbroch"}
, 
[7226] = {Title = "Venomous hunting", 
Description = {"There are gaseous green monsters known as Venomous that have been terrorizing the workers north of Einbroch."}
, Summary = "Hunt 30 Venomous monsters"}
, 
[7227] = {Title = "Teddy Bear hunting", 
Description = {"These Teddy Bears are not the cute and cuddly kind for kids. Hunt 5 of them quickly in the field north of Einbroch"}
, Summary = "Hunt 5 Teddy Bear monsters"}
, 
[7228] = {Title = "Report to Instructor Ur", 
Description = {"Your work in the Einbroch area is done. Return to Eden Group Headquarters and speak to Instructor Ur."}
, Summary = "Report to Instructor Ur back at Eden Group Headquarters."}
, 
[7229] = {Title = "Advanced Training in the Ice Dungeon", 
Description = {"There is an Ice Dungeon Cave if you travel North from Rachel. It\'s a long walk, but it\'s worth it if you can make the trek."}
, Summary = "Find the Dispatched Instructor Naomi in the Ice Dungeon"}
, 
[7230] = {Title = "Siroma hunting", 
Description = {"You can confuse these for giant balls of snow, but they\'re actually monsters in disguise."}
, Summary = "Hunt 30 Siroma monsters and return to Naomi near the cave entrance."}
, 
[7231] = {Title = "Hunting and Gathering", 
Description = {"Now that you have a feel for it, hunt 30 more Siromas and 30 Ice Cubic, 1 Sweet Sauce and 1 Milk to Naomi."}
, Summary = "Hunt more Siromas and bring materials."}
, 
[7232] = {Title = "Report to Instructor Ur", 
Description = {"You are done hunting in the Ice Dungeon. Return to Eden Group Headquarters and speak to Instructor Ur."}
, Summary = "Report to Instructor Ur back at Eden Group Headquarters."}
, 
[7233] = {Title = "Advanced Training at Ash Vacuum", 
Description = {"Since you at the third-class job level, you should be able to fight the monsters at Ash Vacuum pretty easily."}
, Summary = "Find the Dispatched Instructor Margaret at the Midgard Expedition Camp"}
, 
[7234] = {Title = "Margaret\'s favor", 
Description = {"Margaret asked you to find the Dispatched Instructors Meeru and Mine. They\'re located in the fields just West and East of the Midgard Expedition Camp."}
, Summary = "Find Meeru and Mine, complete their quests, and return to Margaret"}
, 
[7235] = {Title = "Nepenthes Hunt", 
Description = {"Meeru asked you to hunt 1 Nepenthes monster at Manuk Field and return to him."}
, Summary = "Hunt 1 Nepenthes monster and return to Meeru"}
, 
[7236] = {Title = "Pinguicula Hunt", 
Description = {"Mine asked you to hunt 5 Pinguicula monsters instead."}
, Summary = "Hunt 5 Pinguicula monsters and return to Mine"}
, 
[7237] = {Title = "Report to Instructor Ur", 
Description = {"Your training is done at Ash Vacuum. Return to Eden Group Headquarters and speak to Instructor Ur."}
, Summary = "Report to Instructor Ur back at Eden Group Headquarters."}
, 
[7238] = {Title = "Errands for Thorn (easy)", 
Description = {"Thorn needs materials for refining, so bring him 20 Iron Ore and 10 Iron."}
, Summary = "Collect 20 Iron Ore and 10 Iron"}
, 
[7239] = {Title = "Errands for Thorn (hard)", 
Description = {"Thorn needs materials for refining, so bring him 20 Used Iron Plate"}
, Summary = "Collect 20 Used Iron Plate"}
, 
[7240] = {Title = "Equipment Enhancement", 
Description = {"Bring your new Eden Group Equipment to Thorn and ask him to strengthen it for you, and he will give you a random equipment bonus."}
, Summary = ""}
, 
[7241] = {Title = "Errands for Thorn timer", 
Description = {"Return to Thorn after waiting 24 hours."}
, Summary = ""}
, 
[7242] = {Title = "Play with the baby cat", 
Description = {"The request from Rato, an expert cat sailor in Malangdo. He worries about the baby cats so has asked you find them and play with them. Go to find the <NAVI>[baby cats]<INFO>malangdo,213,202,0,101,0</INFO></NAVI>. They are Rosy the white one, Roku the black one, and Charo the gold one."}
, Summary = ""}
, 
[7243] = {Title = "Nyadventure-Duruduru Compass", 
Description = {"You received Adventure Card A from the baby cats who called themselves the \'Meow Bravery Team\'. The card seems necessary for operating some kind of device made by them. If you insert the card into the <NAVI>[Beginning Compass]<INFO>malangdo,213,202,0,101,0</INFO></NAVI>, the game will start."}
, Summary = ""}
, 
[7244] = {Title = "Nyadventure-Duruduru Race", 
Description = {"Duruduru Compass Race has started. You have to finish the race in the correct order within a limited time. The order of the compass is [Red Flame] -> [Blue Flame] -> [Gold Flame] -> [Forest] -> [Cloud]."}
, Summary = ""}
, 
[7245] = {Title = "Nyadventure-Duruduru Race", 
Description = {"Duruduru Compass Race has started. You have to finish the race in the correct order within a limited time. The order of the compass is [Gold Flame] -> [Blue Flame] -> [Cloud] -> [Forest] -> [Red Flame]."}
, Summary = ""}
, 
[7246] = {Title = "Nyadventure-I\'m coming now.", 
