, Summary = ""}
, 
[7247] = {Title = "Nyadventure-Stop the Bang!", 
Description = {"Homnya, a doubtful cat who calls himself a \'real detective\', and his friend Nyangson say that if the <NAVI>[machine]<INFO>malangdo,174,178,0,101,0</INFO></NAVI> in front explodes, all of Malangdo will be destroyed. So they ask you to stop the machine."}
, Summary = ""}
, 
[7248] = {Title = "", 
Description = {""}
, Summary = ""}
, 
[7249] = {Title = "Nyadventure-Bang! See you next time", 
Description = {"According to <NAVI>[Homnya]<INFO>malangdo,172,178,0,101,0</INFO></NAVI> and Nyangson, this Bang machine causes a problem every minute. You never know when you\'re going to be in trouble. Check on the machine again tomorrow."}
, Summary = ""}
, 
[7250] = {Title = "Nyadventure-Hidden Treasure?", 
