Description = {"Delivered the Spiritual Protection to Romel!"}
, Summary = ""}
, 
[7388] = {Title = "Maries\'s Child", 
Description = {"Let\'s find the ^4d4dffInside-out Shirt^000000 for Maries\'s child who is lost in the woods. The shirt must have been taken by an animal or a monster."}
, Summary = ""}
, 
[7389] = {Title = "Give the Shirt to Maries\'s Child", 
Description = {"Gave the shirt to Maries\'s child. The child will wear the shirt and go home safely. I\'ll have to let Maries know that everything is alright now."}
, Summary = ""}
, 
[7390] = {Title = "Worried about Maries\'s Child", 
Description = {"From the child\'s story, it looks like there is a mischievous spirit that fools people into losing their way. This means the child might get lost again. If you are worried, stop by <NAVI>[Maries]<INFO>ma_fild01,200,190,0,101,0</INFO></NAVI> again."}
, Summary = ""}
, 
[7391] = {Title = "Jejeling and Jejellopy", 
Description = {"Collection Dealer, Woeon, collects Jejellopys and asked you to help collect them. Hunt down Jejelings nearby and collect the Jejellopy they drop. Deliver 30 Jejellopy to Woeon."}
, Summary = "Deliver 30 Jejellopy to Woeon"}
, 
[7392] = {Title = "Collect Jejellopy Regularly", 
Description = {"Jejellopy is manufactured to be used as material in various products. Woeon will need as many Jejellopy as he can get. Let\'s visit <NAVI>[him]<INFO>malaya,295,171,0,101,0</INFO></NAVI> when I have spare time."}
, Summary = ""}
, 
[7393] = {Title = "Shiny Silver Blade", 
Description = {"Cub Blacksmith Pandoi\'s dream is to make a Silver Blade weapon. Collect 10 Silver Bracelets from monsters in the hospital."}
, Summary = "10 Silver Bracelets, and Defeat Manananggal and Tiyanak"}
, 
[7394] = {Title = "Shiny Tomorrow", 
Description = {"Go back to <NAVI>[Pandoi]<INFO>malaya,119,217,0,101,0</INFO></NAVI> after a day. If he failed to create a Silver Blade, then he will need your help to get more Silver Bracelets."}
, Summary = ""}
, 
[7395] = {Title = "Ghost on the Perry Ship", 
Description = {"You decided to see for yourself whether Pedro\'s story about the Perry Ship being haunted is true. Ghosts around here seem to be afraid of me, so let\'s not be afraid to board the ship."}
, Summary = "Investigate the Perry Ship."}
, 
[7396] = {Title = "Angry Soul on Perry Ship", 
Description = {"Was treated badly on the Perry Ship by an angry girl spirit. Let\'s look for a solution."}
, Summary = "Talk to Pedro the Mumbaki."}
, 
[7397] = {Title = "Mumbaki Phong\'s Advice", 
Description = {"Mumbaki Phong said not to avoid the spirit but to embrace and soothe it. Let\'s look for flowers to offer. You can get flowers from the animals and monsters nearby."}
, Summary = "3 Elegant Flowers, 3 Mysterious Flowers, 3 Beautiful Flowers"}
, 
[7398] = {Title = "Offering Bouquet Recommended by Mumbaki", 
Description = {"Mumbaki Phong blessed the flowers you brought to him and made them into an Offering Bouquet. Let\'s take this bouquet to Soul Diwata on the Perry Ship."}
, Summary = "Offer the Bouquet to Diwata."}
, 
[7399] = {Title = "Soul Diwata\'s Story", 
Description = {"Diwata said she was bullied by native ghosts because she was from outside of the village. Perry Ship is stuck because of Diwata\'s powerful soul."}
, Summary = "Share this information with Pedro."}
, 
[7400] = {Title = "Mumbaki of Port Malaya", 
Description = {""}
, Summary = ""}
, 
[7401] = {Title = "All Aboard for Perry Sailing", 
Description = {"Looks like the Perry Ship can operate regularly for the time being. But let\'s check up with <NAVI>[sailor Pedro]<INFO>malaya,326,68,0,101,0</INFO></NAVI> after a day. There still is a chance of native ghosts bullying Diwata."}
, Summary = ""}
, 
[7402] = {Title = "Bouquet for Diwata", 
Description = {"Decided to create a bouquet to calm Diwata down from fighting with the native ghosts. Gather flowers for Mumbaki Phong to bless."}
, Summary = "3 Elegant Flowers, 3 Mysterious Flowers, 3 Beautiful Flowers"}
, 
[7403] = {Title = "Stabilized Perry", 
Description = {"Diwata calmed down after receiving the bouquet. The Perry Ship can start sailing again. Let\'s tell Pedro."}
, Summary = ""}
, 
[7404] = {Title = "Eliminate Jejeling", 
Description = {"Decided to help some peddlers traveling to and from Baryo by eliminating Jejelings. Try to eliminate of 20 Jejelings today."}
, Summary = "20 Jejelings"}
, 
[7405] = {Title = "Eliminate Jejeling - Same Time Tomorrow", 
Description = {"Getting rid of Jejelings is an ongoing project that needs lots of help. To participate, meet the <NAVI>[Guard]<INFO>malaya,266,76,0,101,0</INFO></NAVI> after a day."}
, Summary = ""}
, 
[7406] = {Title = "Agreeing to Collect Bones!", 
Description = {"Collect bones for the guard dog Vantai. Collected bones must be purified. Take the collected Evil Spirit Bones to Mumbaki Kiko to purify them."}
, Summary = "10 Evil Spirit Bones, 10 Holy Water"}
, 
[7407] = {Title = "Purified Bone", 
Description = {"Received Purified Spirit Bones after Mumbaki Kiko\'s ritual. Let\'s take them to Quarter."}
, Summary = "Deliver 10 Purified Spirit Bones to Quarter."}
, 
[7408] = {Title = "Agree to Come Back Tomorrow?", 
Description = {"<NAVI>[Guard Quarter of Baryo Mahiwaga]<INFO>ma_fild01,239,253,0,101,0</INFO></NAVI> would like to have more bones to give to Vantai tomorrow. Let\'s visit again after a day."}
, Summary = ""}
, 
[7409] = {Title = "Cannot Meet Eyes with Him!", 
Description = {"Self-claimed Good Capre Budidai cannot bear to see his friends being bullied by the Bungisngis. Bungisngis were too powerful for Budidai to handle, and now he is asking if you can help him take care of the one-eyed monsters."}
, Summary = "Eliminate 10 Bungisngis"}
, 
[7410] = {Title = "Teach Another Lesson Tomorrow!", 
Description = {"<NAVI>[Capre Budidai]<INFO>ma_fild02,241,39,0,101,0</INFO></NAVI> said the Bongisungisu won\'t go away from one scare and asks to continue threatening them. Come back after a day."}
, Summary = ""}
, 
[7411] = {Title = "The traveler, Fome\'s story", 
Description = {"Listened to the story regarding the Laphines and Eclage."}
, Summary = ""}
, 
[7412] = {Title = "The traveler, Litrip\'s story", 
Description = {"Listened to the story regarding Bifrost Tower."}
, Summary = ""}
, 
[7413] = {Title = "The traveler, Chiba\'s story", 
Description = {"Listened about Laphines\' organization and roles."}
, Summary = ""}
, 
[7414] = {Title = "Eclage guard\'s message", 
Description = {"Someone from Eclage wanted to meet. Ask for directions from the guard near the east exit of the Eclage Plaza."}
, Summary = "Talking with the guard at the east exit of Eclage."}
, 
[7415] = {Title = "Laphine\'s Chief of Staff", 
Description = {"Planned to meet someone based on the instructions from the Eclage guard. If lost, ask for directions from the guard again."}
, Summary = "Talking with the Chief of Staff."}
, 
[7416] = {Title = "Waiting to meet", 
Description = {"After talking with the Chief of Staff, was requested to meet with King of Laphines?Mayor Jun. Once the wait is over, let\'s ask the Eclage guard again for more directions."}
, Summary = "Asking for directions after waiting."}
, 
[7417] = {Title = "Kardui\'s request", 
Description = {"Mayor Jun did not listen to my stories, but instead said that he would be only interested in listening if I were to make more of a significant contribution to Eclage. Let\'s take care of the Laphines in Eclage that need help."}
, Summary = "Working for Eclage."}
, 
[7418] = {Title = "For Eclage 1", 
Description = {"Obtain ingredients to decorate the Yai for the Eclage guard who is too busy to do it himself. Horns of Hilsrion, Mystic Horns, and Horseshoes will do the trick."}
, Summary = "5 Horn of Hilsrion, 5 Mystic Horns, 5 Horseshoes."}
, 
[7419] = {Title = "For Eclage 2", 
Description = {"Decided to deliver mail from the Splendide Contact Officer as a favor for Roy the messenger who was having trouble at the edge of Bifrost due to communications getting cut off."}
, Summary = "Splendide Contact Officer and Mailbox."}
, 
[7420] = {Title = "For Eclage 3", 
Description = {"For Leo who loves sweets, get him Splendide-made Pinguicula\'s Fruit Jam and Luciola\'s Honey Jam. Fruit jam and honey jam can be obtained using coins at the advanced base."}
, Summary = "3 Pinguicula\'s Fruit Jam, 3 Luciola\'s Honey Jam."}
, 
[7421] = {Title = "That\'s enough.", 
Description = {"While working on various jobs, Kardui\'s message reached me. Must go and meet Kardui. His office will be on the top floor when following the spiral road."}
, Summary = "Talking with Kardui."}
, 
[7422] = {Title = "Kardui\'s gift", 
Description = {"Kardui said he prepared a gift that can be picked up from Chief of Staff, Shenime. What could it be..."}
, Summary = "Receiving the gift through Shenime."}
, 
[7423] = {Title = "A Rumor about the King 1", 
Description = {"During the conversation with Leo, unsettling things about Kardui were told. He didn\'t seem to get into details, but it was still very concerning. "}
, Summary = ""}
, 
[7424] = {Title = "A Rumor about the King 2", 
Description = {"Fome shared something unexpected. Apparently, the Laphines have a subtle dislike of Kardui. This was similar to what Leo seemed to want to keep to himself earlier."}
, Summary = ""}
, 
[7425] = {Title = "A Rumor about the King 3", 
Description = {"A connection between Cenes\'s despotism and Kardui was made through talking with the Laphines. It is not too serious, but it is certain that the current king Kardui is being considered in a way similar to how Cenes was."}
, Summary = ""}
, 
[7426] = {Title = "A Rumor about the King 4", 
Description = {"Most recently, Kardui seemed to have become Mayor Jun in the midst of the calamity facing the entire Laphine race. They don\'t seem to completely disagree with his policies, but they don\'t seem to agree with them either."}
, Summary = ""}
, 
[7427] = {Title = "At times like this, face it straight on!", 
Description = {"The truth behind the Laphine\'s anxiety and fear toward Kardui can no longer be elucidated. Shouldn\'t this at least be communicated to the individual of interest? It might be possible to hear about the reason behind it all..."}
, Summary = "Talk with Kardui."}
, 
[7428] = {Title = "Yai of the wild", 
Description = {"Obtain items for the Yai of Eclage guard Minuel who stands post every day and night."}
, Summary = "10 Horn of Hilsrion, 10 Mystic Horns, 10 Horseshoes."}
, 
[7429] = {Title = "Wild recent trend!", 
Description = {"The items collected for <NAVI>[Minuel]<INFO>ecl_in01,82,70,0,101,0</INFO></NAVI> seems to have created a sensation among Yai decorations. Let\'s obtain the items regularly to keep the trend going."}
, Summary = "Check in with Minuel after some time."}
, 
[7430] = {Title = "Deliveryman that runs through space", 
Description = {"Delivered mails from Splendide in place of Roy who is still having trouble at the edge of Bifrost."}
, Summary = "Splendide Contact Office, Mailbox."}
, 
[7431] = {Title = "A mailman never rests!", 
Description = {"Mail requires regular deliveries. Let\'s check in again with <NAVI>[Roy]<INFO>ecl_fild01,205,86,0,101,0</INFO></NAVI> later."}
, Summary = "Check in with Roy after some time."}
, 
[7432] = {Title = "The troublemakers in Blooming Flower Land", 
Description = {"Let\'s show the Menblatt and Petals that annoy travelers who\'s boss! It\'s reported as patrolling, but it\'s actually elimination."}
, Summary = "Eliminating Menblatt and Petals. "}
, 
[7433] = {Title = "Need constant guidance", 
Description = {"<NAVI>[Leo]<INFO>eclage,112,40,0,101,0</INFO></NAVI> once again asks me to patrol and subjugate the Menblatt and Petals. Let\'s check in with him later."}
, Summary = "Check with Leo after some time."}
, 
[7434] = {Title = "Kardui\'s big brother", 
Description = {"Kardui wants to send a letter to his big brother. Kardui\'s brother lives at the top of Bifrost Tower. Let\'s deliver it to him."}
, Summary = "Deliver the letter."}
, 
[7435] = {Title = "Time for reading the letter", 
Description = {"Hisie asked for some time to read the letter. It should only take a couple of minutes, so let\'s wait a moment."}
, Summary = "Wait until he is done reading the letter."}
, 
[7436] = {Title = "Avant, the Scholar of Magics", 
Description = {"In Kardui\'s letter, there was not only greetings and salutations, but also a request to look for their father, Avant the Scholar of Magics. Help Hisie to find out more about the scholar from within Eclage."}
, Summary = ""}
, 
[7437] = {Title = "Shenime\'s favor", 
Description = {"Could not obtain information on Avant,but instead got a strange request from Shenime. Asked to gather experimental ingredients for the scholar of magics he sponsors. They are 10 Dustballs, 10 Leaf Bookmarks."}
, Summary = "10 Dustballs, 10 Leaf Bookmarks."}
, 
[7438] = {Title = "Secret sponsorship", 
Description = {"Shenime did not share the slightest about the scholar of magics he sponsors, and asks me to forget about finding any further information about it. Is there anyone who knows something?"}
, Summary = "Search for information."}
, 
[7439] = {Title = "The scholar of magics sponsored by Shenime", 
Description = {"Hisie said that if you track down Shenime, the location of the scholar might be identified as well. Find out Shenime\'s duties."}
, Summary = "Search for information."}
, 
[7440] = {Title = "Minuel\'s witness", 
Description = {"Eclage guard Minuel said that Shenime often travels east, in the opposite direction from his Yai. Discuss with Hisie."}
, Summary = "Talk with Hisie."}
, 
[7441] = {Title = "Mail is here!", 
Description = {"Planned to visit the scholar of magic\'s Yai as if Shenime is sending mail. Hisie will confirm whether that person is Avant. Hisie will provide the information at the crossroads in front of Eclage."}
, Summary = "10 Dustballs, 10 Leaf Bookmarks"}
, 
[7442] = {Title = "The identity of the scholar of magics", 
Description = {"The scholar of magics found through the strategy was indeed Avant. Must tell this to Kardui."}
, Summary = "Talk with Kardui."}
, 
[7443] = {Title = "Interfere with the research!", 
Description = {"A small revenge. Kardui and Hisie want to know what Avant is researching and want to interfere it. Could this be a small revenge plot of the brothers?"}
, Summary = "Interfereing with Avant\'s research."}
, 
[7444] = {Title = "What Avant was researching", 
Description = {"Avant was researching methods to extract the Orb\'s magical power. Since this is dangerous information, the research materials should immediately be returned to Kardui."}
, Summary = "Deliver the research materials to Kardui."}
, 
[7445] = {Title = "Avant\'s back", 
Description = {"Researched the motive behind Avant\'s research on the Orb. The most likely culprit is Avant\'s sponsor, the Chief of Staff. Approach the Chief of Staff to reveal the truth."}
, Summary = "Talk with the Chief of Staff."}
, 
[7446] = {Title = "Unfruitful conversation", 
Description = {"Talked with Shenime the Chief of Staff, but nothing further was learned. He states that he might also have been tricked by Avant. The Chief of Staff was actually upset that Kardui only increased the defenses surrounding the Orb."}
, Summary = "Report to Kardui."}
, 
[7447] = {Title = "Dilemma surrounding the Orb", 
Description = {"It only confirmed the distrust toward Kardui\'s instead of revealing more about Avant\'s research. The Chief of Staff hoped that Kardui\'s judgment has not weakened, and asked that he would demonstrate it."}
, Summary = "Report to Kardui."}
, 
[7448] = {Title = "Something\'s not right", 
Description = {"After talking with Kardui and Hisie, it is decided that the Chief of Staff is indeed the most suspicious. What is the reason behind his resistance toward Kardui\'s actions toward the Orb?"}
, Summary = "Surveillance of the Chief of Staff."}
, 
[7449] = {Title = "Temptation toward the Orb", 
Description = {"The Chief of Staff asked to go to the Orb\'s lighting room to discuss it. I decided to let Kardui know about this after telling him to give me some time to think about it."}
, Summary = "Report to Kardui."}
, 
[7450] = {Title = "Orb\'s lighting room", 
Description = {"Not sure why the Chief of Staff kept trying to lure me into the Orb\'s lighting room, but I decided to go there even just to figure out why. Let\'s go along with what he wants for now."}
, Summary = "Hold hands with the Chief of Staff."}
, 
[7451] = {Title = "Betrayal", 
Description = {"Everything is so confusing. The monster battled in the lighting room was not a subordinate of the King of Demons. They controlled me without my knowledge. Shenime the Chief of Staff betrayed all!"}
, Summary = "Report to Kardui."}
, 
[7452] = {Title = "Find the Chief of Staff!", 
Description = {"Shenime, the Chief of Staff, who was responsible for all these occurrences, has hidden his whereabouts. According to Hisie\'s sources, a faint, residual magic force was felt in Bifrost."}
, Summary = "Survey Northern Bifrost."}
, 
[7453] = {Title = "The last of the Chief of Staff", 
Description = {"The road from the north to the south in Bifrost. It used to be an open path, but now it is currently blocked by a huge rift in the south. On the way to the rift, the Chief of Staff\'s corpse was found."}
, Summary = "Report to Kardui."}
, 
