, 
[7488] = {Title = "Trio set of Fire Elements", 
Description = {"Kaiser killed 5 each of the Fire Element monsters: \'Drops\', \'Picky\' & \'Baby Desert Wolf\' near Morocc. You can find them in the south and southeastern fields of Morocc."}
, Summary = "Kill the Fire Element monsters"}
, 
[7489] = {Title = "Silent liquidation plan", 
Description = {"On the miscellaneous assignment signboard, you were requested to secretly kill one Familiar. Kill the Familiar in the pyramid dungeon west of Morocc."}
, Summary = "Liquidation of Familiar"}
, 
[7490] = {Title = "Mushroom soup calling memories ", 
Description = {"The miscellaneous assignment signboard asks you to find mushrooms. Meet Mash near the oasis before going to the mushroom farm. Return with 3 Orange Gooey Mushroom."}
, Summary = "3 Orange Gooey Mushroom"}
, 
[7491] = {Title = "Get away to Paradise!", 
Description = {"For no reason, you accepted the quest to go to Paradise Squad. ‘Paradise?in the name makes you feel something good."}
, Summary = "Visit to Paradise Squad"}
, 
[7492] = {Title = "Invincible pumpkin knight", 
Description = {"Request to kill the invincible amber knight. You can meet him in the western field of Prontera. Use Kafra teleport service and go to Prontera."}
, Summary = "Kill the amber knight"}
, 
[7493] = {Title = "Battle of 17 vs. 1", 
Description = {"Silent shadow approaching through the severe sand storm..! Win 17 Scorpions! They are in the southern field of Morocc."}
, Summary = "Remove Scorpions"}
, 
[7494] = {Title = "Cleanup of the mushroom farm", 
Description = {"You were requested to eliminate 10 Chonchons and Pabres that have been getting into the mushroom farm through Mash in front of the pyramid."}
, Summary = "Cleanup Chonchons and Pabres"}
, 
[7501] = {Title = "Suspicious Babe 1", 
Description = {"A request to eliminate Suspicious Babes that appear during Multiplayer Battle Arena hours at the fortress in Gloria in Multiplayer Battle Arena TE. Target number: 1 Suspicious Babe."}
, Summary = "Suspicious Babe eliminated"}
, 
[7502] = {Title = "10 Suspicious Babes", 
Description = {"A request to eliminate Suspicious Babes that appear during Multiplayer Battle Arena hours at the fortress in Gloria in Multiplayer Battle Arena TE. Target number: 10 Suspicious Babes."}
, Summary = "Suspicious Babes eliminated"}
, 
[7503] = {Title = "30 Suspicious Babes", 
Description = {"A request to eliminate Suspicious Babes that appear during Multiplayer Battle Arena hours at the fortress in Gloria in Multiplayer Battle Arena TE. Target number: 30 Suspicious Babes."}
, Summary = "Suspicious Babes eliminated"}
, 
[7504] = {Title = "Destroy 1 Emperium", 
Description = {"Emperium destroying: the flower of Multiplayer Battle Arena! Destroy at least 1 Emperium appearing at the fortresses in Gloria and Kafragaten in Multiplayer Battle Arena. Target number: 1 Emperium"}
, Summary = "Emperium destroyed"}
, 
