[7671] = {Title = "Find my Lost lamb.", 
Description = {"Use the ^4d4dffRope^000000 on to ^4d4dffLost Lambs^000000 wandering Rune Midgard."}
, Summary = "Retrieve 5 lost lambs"}
, 
[7672] = {Title = "The lambs keep running away.", 
Description = {"The guard dog seems to be scaring the lambs away regularly. Come back after a few hours and Bori will likely have lost more lambs."}
, Summary = "Return to Bori after the timer has expired"}
, 
[7711] = {Title = "Beginning", 
Description = {"Yo Ho! I am a fabulous Doram from Pasta! I climbed Laviol mountain, and came to Lasagna port. And now I\'m going to take over the new continent Midgard!"}
, Summary = "Talk to Ajena"}
, 
[7712] = {Title = "Where am I? Who am I??", 
Description = {"Yo Ho! I am a fabulous Doram from Pasta! Road to Port town Lasagna, the Vigilante Aglio can tell you more."}
, Summary = "Talk to Aglio"}
, 
[7713] = {Title = "First Battle!", 
Description = {"I knew it. Vigilante Aglio wants to check my ability. An Eggring is nothing for my foot punch!"}
, Summary = ""}
, 
[7714] = {Title = "Refreshing Apple Juice", 
Description = {"There\'s nothing like sweet, cold drink after work. Vigilante Aglio seems to understand."}
, Summary = "Drink Apple Juice"}
, 
[7715] = {Title = "Midding Box", 
Description = {"A kid from town is saying he lost a delivery box. A Doram\'s duty is to help the kid! Let\'s hunt Eggrings to find the box. Return to Aglio once you\'ve found it."}
, Summary = "Collect Delivery Box"}
, 
[7716] = {Title = "To the Village!", 
Description = {"Took back the box from Eggring. Vigilante Aglio wants me to deliver this to the kitten at the Lasagna tool shop. Delievery is an adventure!"}
, Summary = "Talk to Tool shop kitten"}
, 
[7717] = {Title = "Merchant\'s Kindness", 
Description = {"Toolshop owner gave me some useful items, and has asked me to find ^4d4dffHaru the Healer^000000. Haru the Healer lives in ^4d4dffthe house full of flowerpots, east from the toolshop^000000."}
, Summary = "Talk to Haru the Healer"}
, 
[7718] = {Title = "I\'m used to this", 
Description = {"Move to the meadow near the village, work on ^4d4dffRed Grass^000000 and come back with ^4d4dff1 Red Herb^000000. It\'s needed for the medicine, so let\'s get moving."}
, Summary = "1 Red Herb"}
, 
[7719] = {Title = "Time to Digest", 
Description = {"To help the cat in front of Lasagna village, lets do some labor. Work on ^4d4dffRed Grass and collect 2 Red Herbs^000000. Piece of cake!"}
, Summary = "2 Red Herb"}
, 
[7720] = {Title = "Service Manual", 
Description = {"Learned a lot about how to use the warehouse, and the location saving service as well."}
, Summary = ""}
, 
[7721] = {Title = "Cat showoff contest", 
Description = {"A bet has started! To win, hunt down 3 Lunatics and 2 Fabres the fastest. Lunatics and Fabres seems to live nearby."}
, Summary = "You have 10 minutes to hunt the following:"}
, 
[7722] = {Title = "EMT", 
Description = {"Learned emergency medical treatment."}
, Summary = ""}
, 
[7723] = {Title = "The potential within", 
Description = {"Learned about status and ability. Let\'s talk more with Vigilante Nyoki about this."}
, Summary = "Talk to Nyoki"}
, 
[7770] = {Title = "Sleepless night, return to the sea beyond ", 
Description = {"Acher, who is going through sleepless nights every day because of an unidentified wail, thinks that the Banshee on the Isle of Unknown is the cause. "}
, Summary = "Banshee Hunting"}
, 
[7771] = {Title = "Please cleanse the sanctuary! ", 
Description = {"Eridanus, who works at the temple, says that he hears a suspicious sound from the basement of the temple, and asks you to eliminate whatever is making it. Hunt^4d4dffHodremlin, Isilla, Vanberk^000000"}
, Summary = "Defeat the monsters that appear in the sanctuary "}
, 
[7772] = {Title = "It must be a ghost! ", 
Description = {"Rigel, a student at the Kil-Hyr academy, asks you to investigate the strange noise coming from the closed cathedral. Open the door of the closed cathedral and enter. "}
, Summary = "Admission to the Closed Cathedral "}
, 
[7773] = {Title = "For in-depth investigation ", 
Description = {"The interior of the closed cathedral consists of complex facilities. Paradise Unit Kursa enters the second floor and defeats Elliott. And finds ^4d4dffone Burnt Part^000000."}
, Summary = "One Burnt Part"}
, 
[7774] = {Title = "Suspicious Tunnel ", 
Description = {"I learned the way to the underground facility through Isla. "}
, Summary = ""}
, 
[8000] = {Title = "Quitting Job Change", 
Description = {"Give up changing your job to Assassin and go back to town. "}
, Summary = "Quit Job Change to Assassin"}
, 
[8001] = {Title = "Job Change to Assassin", 
Description = {"Fill out the form to apply for the job of Assassin and take the test."}
, Summary = "Applying for Job Change to Assassin"}
, 
[8002] = {Title = "Job Change to Assassin", 
Description = {"You must get at least 9 out of 10 questions correct to pass the test."}
, Summary = "Written Test for Job Change to Assassin"}
, 
[8003] = {Title = "Job Change to Assassin", 
Description = {"You must catch 6 \'Job change targets\' to pass the test."}
, Summary = "Catch all 6 Job change targets!"}
, 
[8004] = {Title = "Job Change to Assassin", 
Description = {"Your Hide skill is to be tested. You must use your hide skills with potions until you reach the other side of the room without killing any monsters."}
, Summary = "No monsters should be killed."}
, 
[8005] = {Title = "Job Change to Assassin", 
Description = {"Go to the final testing hall."}
, Summary = ""}
, 
[8006] = {Title = "Find the Guild Master!", 
Description = {"You must go through the maze and find the Guild Master."}
, Summary = "Find the Guild Master!"}
, 
[8007] = {Title = "Acceptance from the Guild Master", 
Description = {"Bring the Necklace from the Guild Master and go meet the Assassin Expert \'Huey.\'"}
, Summary = "Delivery of the necklace from the Guildmaster"}
, 
[8008] = {Title = "Job Change to Assassin", 
Description = {"You\'ve now become an Assassin !!"}
, Summary = "Job Change to Assassin"}
, 
[8009] = {Title = "Applying for Job Change to Priest", 
Description = {"Accept the Three Trials of Priesthood to change the job."}
, Summary = "Applying for Job Change to Priest."}
, 
[8010] = {Title = "Job Change to Priest", 
Description = {"You must make a pilgrimage. First, visit Rubalkabara, who is to the northeast of the Prontera Ruins. Second, visit Sister Mathilda who is near Morroc, southwest of Prontera. Finally, visit Father Yosuke in a field northwest of Prontera."}
, Summary = "First trial, a Pilgrimage"}
, 
[8011] = {Title = "Job Change to Priest", 
Description = {"Move to the place where the Spiritual Training takes place. Talk to Peter S. Alberto."}
, Summary = "Second trial, the Spiritual Training"}
, 
[8012] = {Title = "Job Change to Priest", 
Description = {"Start training. Kill all the monsters! Show no mercy to the creatures of darkness!"}
, Summary = "Second trial, the Spiritual Training"}
, 
[8013] = {Title = "Job Change to Priest", 
Description = {"You\'ve completed the Spiritual Training! Go see Sister Cecilia."}
, Summary = "Job change test to Priest"}
, 
[8014] = {Title = "Job Change to Priest", 
Description = {"Make a promise to devote yourself to God."}
, Summary = "Third trial, your Devotion to God"}
, 
[8015] = {Title = "Job Change to Priest", 
Description = {"You have completed all 3 missions as you made the oath of Priesthood. Go back to Bishop Paul."}
, Summary = "Applying for Job Change to Priest."}
, 
[8016] = {Title = "Job Change to Priest", 
Description = {"You\'ve now become a Priest!"}
, Summary = ""}
, 
[8017] = {Title = "Factory Inspection", 
Description = {"Zelmeto has asked you to help him inspect the machines in the factory one at a time to find out which one needs to be fixed. Find the 2nd control panel and report back to Zelmeto."}
, Summary = ""}
, 
[8018] = {Title = "Factory Inspection", 
Description = {"You have found the 2nd control panel and it\'s completely broken. Report this back to Zelmeto."}
, Summary = ""}
, 
[8019] = {Title = "Factory Inspection", 
Description = {"Zelmeto has asked you to inspect the automatic pressure governors and to report any problems no matter how small they may seem."}
, Summary = ""}
, 
[8020] = {Title = "Factory Inspection", 
Description = {"You have found the automatic pressure governors and after checking more carefully, you find that they\'re making strange grinding noises and a few of the surface screws are loose. Report your findings to Zelmeto."}
, Summary = ""}
, 
[8021] = {Title = "Factory Inspection", 
Description = {"Now Zelmeto has asked you to inspect another control panel. It\'s similar to the first one but bigger. It\'s located in the middle of the factory. Find it and report back to Zelmeto."}
, Summary = ""}
, 
[8022] = {Title = "Factory Inspection", 
Description = {"The main control panel doesn\'t look like it has any problems. But after tapping on its surface, you hear a disheartening hollow sound. It looks like it\'s missing some parts... Report your findings to Zelmeto."}
, Summary = ""}
, 
[8023] = {Title = "Factory Inspection", 
Description = {"Zelmeto has asked you to inspect a mechanical hand that transports small objects. Find it and report your findings to Zelmeto."}
, Summary = ""}
, 
[8024] = {Title = "Factory Inspection", 
Description = {"The conveyor\'s movements look jittery and clumsy. The mechanical arm also doesn\'t look strong enough to bear the loads that it\'s carrying... Report your findings to Zelmeto."}
, Summary = ""}
, 
[8025] = {Title = "Factory Inspection", 
Description = {"Now you must inspect a pipe located near the large cauldrons of molten metal and report your findings to Zelmeto."}
, Summary = ""}
, 
[8026] = {Title = "Factory Inspection", 
Description = {"The pipe you have found is bloated and worn out from long durations of being overloaded with pressure. It\'s a wonder it hasn\'t exploded yet. Report your findings to Zelmeto."}
, Summary = ""}
, 
[8027] = {Title = "Factory Inspection", 
Description = {"The final thing Zelmeto has asked you to inspect is a bigger, more powerful conveyor. Find it and report your findings to Zelmeto."}
, Summary = ""}
, 
[8028] = {Title = "Factory Inspection", 
Description = {"This last conveyor seems to have similar problems to its smaller version. Its movements are awkward, erratic and weak, and almost all of its screws are rusted. Report your findings to Zelmeto."}
, Summary = ""}
, 
[8029] = {Title = "Factory Inspection", 
Description = {"Zelmeto tells you that he needs to request an increase in the factory repair budget from the superintendent to make sure they have enough materials for the repairs. Find the superintendent."}
, Summary = ""}
, 
[8030] = {Title = "Factory Inspection", 
Description = {"The superintendent refuses to approve the increase in the factory repair budget. You\'d better report the bad news to Zelmeto."}
, Summary = ""}
, 
[8031] = {Title = "Factory Inspection", 
Description = {"Zelmeto still wants to make the repairs, so he has asked you to bring back ^FF000020 Flexible Tube^000000, ^FF000010 Rusty Screw^000000, and ^FF000010 Used Iron Plate^000000 so they can make the needed repairs."}
, Summary = ""}
, 
[8032] = {Title = "Tarlock\'s Favor", 
Description = {"Tarlock says that he wouldn\'t mind telling you how the Airship works if you do him the favor of delivering a letter to his brother, Ferlock."}
, Summary = "Deliver Tarlock\'s letter to his brother."}
, 
[8033] = {Title = "Ferlock\'s Favor", 
Description = {"Ferlock has asked you retrieve his stolen things from the monsters that attack Tarlock\'s Airship."}
, Summary = "Bring 2 Will of the Darkness and 2 Prickly Fruit back to Ferlock."}
, 
[8034] = {Title = "Ferlock\'s Favor", 
Description = {"Ferlock asks you to take his reply to his brother Tarlock for him."}
, Summary = "Deliver the letter from Ferlock to his brother, Tarlock."}
, 
[8035] = {Title = "How the Airship Works", 
Description = {"You have delivered Ferlock\'s letter to Tarlock. Now may be a good time to ask him about how the airship works."}
, Summary = "Continue speaking to Tarlock."}
, 
[8036] = {Title = "Hallen\'s Favor", 
Description = {"Hallen has asked you to deliver a letter to Kaci from someone named Mr. Mawong who is something like her mentor."}
, Summary = "Deliver the letter to Kaci."}
, 
[8037] = {Title = "The Dice Roller", 
Description = {"You have delivered Hallen\'s letter to Kaci. You should probably find out what she knows..."}
, Summary = ""}
, 
[8038] = {Title = "The Dice Roller", 
Description = {"It turns out that Kaci is Hallen\'s cousin. After answering your questions she has gone back to running her games. Who else would know of their past?"}
, Summary = ""}
, 
[8039] = {Title = "The Secret of Airships", 
Description = {"Hallen tells you that his project is to learn more about how the Airships work. It could benefit you to ask someone who would be knowledgeable about Airships for yourself and report your findings to Hallen."}
, Summary = ""}
, 
[8040] = {Title = "The Secret of Airships", 
Description = {"Really...? Are you serious? An imitation of Ymir\'s Heart Piece. Now where have I heard about that before? Mm, let me think... "}
, Summary = "Continue talking to Hallen."}
, 
[8041] = {Title = "The Secret of Airships", 
Description = {"Kaci told me about a drunkard that always mentions Ymir\'s Heart when he plays the Dice game for Apples!"}
, Summary = " "}
, 
[8042] = {Title = "The Secret of Airships", 
Description = {"You find out that the director at the Einbroch Laboratory has a piece of Ymir\'s Heart. It\'s worth investigating..."}
, Summary = " "}
, 
[8043] = {Title = "The Secret of Airships", 
Description = {"You\'d better get out of here. The guards patrol this place regularly, so you\'re almost sure to get caught. Hmm, come and see me later at the Airship, alright? Now hurry!"}
, Summary = "You must go and see Ferlock."}
, 
[8044] = {Title = "Euslan\'s Fiancee", 
Description = {"...Are you really willing to go out and look for Thierry for me? Oh, thank you so much! You don\'t know how much your kind offer means to me. Thierry went on a trip, traveling on one of the Airships, to find some medicine that the doctors say I need for my illness."}
, Summary = " "}
, 
[8045] = {Title = "Tips from Kaci", 
Description = {"Ah, I know! I\'ll ask the Airship Captain to help you; he\'s got the list of passengers and their destinations."}
, Summary = "Check out the passenger list from the captain."}
, 
[8046] = {Title = "Ferlock\'s Passenger list", 
Description = {"According to this, he last took an Airship to Hugel. That\'s all that this says."}
, Summary = " "}
, 
[8047] = {Title = "Euslan\'s Favor", 
Description = {"If you get the chance, please visit my brother Eukran in Hugel, and ask him where my Thierry might be."}
, Summary = " "}
, 
[8048] = {Title = "Eukran\'s Testimony", 
Description = {"You see, Thierry passed by here about a month ago, and told me that he had to visit the Odin Shrine. I wasn\'t sure then, but now I think he\'s trying to help my sister."}
, Summary = " "}
, 
[8049] = {Title = "Thierry\'s Favor", 
Description = {"I can\'t really go into the details, but I\'m doing this work to find a cure for Euslan\'s disease. It\'s not curable with modern medicine..."}
, Summary = " "}
, 
[8050] = {Title = "Danger coming to Thierry", 
Description = {"Thierry seems to have caught on to what we\'re really up to. I think that\'s why he\'s slowing down on his research. We\'d better get rid of him before it\'s too late."}
, Summary = " "}
, 
[8051] = {Title = "Euslan\'s Medicine", 
Description = {"It doesn\'t matter what happens to me, but I must save Euslan. I only need 5 Runes of the Darkness to finish that medicine. Please help me get them, Adventurer..."}
, Summary = "Gather 5 Runes of the Darkness"}
, 
[8052] = {Title = "Thierry\'s Favor", 
Description = {"Please understand that I want to see her as soon as I can, but I have to wait until those Rekenber agents stop searching for me. Please give that medicine to Euslan as soon as you can; her life depends on it."}
, Summary = "Deliver the medicine to Euslan."}
, 
[8053] = {Title = "Find Postell", 
Description = {"Find Allen\'s son, Postell, and tell him to bring his medicine! Head east, leave the town, and you should be able to find Postell."}
, Summary = "Postell"}
, 
[8054] = {Title = "Message from Postell", 
Description = {"Postell has asked you to do him a favor and make sure that his dad doesn\'t get himself into any more trouble."}
, Summary = "Go back to Allen"}
, 
[8055] = {Title = "Nursing Allen", 
Description = {"Wh-what if I have another ulcer attack before Postell can bring my meds?! I might not survive! A-adventurer, would you please stay by my side until my son arrives?"}
, Summary = "Take care of Allen."}
, 
[8056] = {Title = "A little something in return", 
Description = {"\'\'Please take a look inside the medicine drawer, and help yourself to whatever you like\'\' ~Allen"}
, Summary = "Look inside the medicine drawer."}
, 
[8057] = {Title = "Grumbling Manainne", 
Description = {"Speak to Manainne about the comforting tree."}
, Summary = ""}
, 
[8058] = {Title = "Conversation with El Schatt", 
Description = {"\'\'This tree means so much to everyone in this town, and we all have special memories of this place. But that El Schatt fellow plans to chop it down for his shop...\'\' - Manainne"}
, Summary = ""}
, 
[8059] = {Title = "Conversation with Perfitz", 
Description = {"El Schatt says that his father\'s been wanting to build a shop here for a long time. Talk to his father, Perfitz, and get his side of the story."}
, Summary = ""}
, 
[8060] = {Title = "Stubborn El Schatt", 
Description = {"\'\'Although I\'m pleased, I get this gut feeling that something\'s not right, like he\'s too excited about cutting that tree down. Maybe this old man is just too suspicious!\'\' - Perfitz"}
, Summary = ""}
, 
[8061] = {Title = "Stories of the past", 
Description = {"El Schatt says that there was a time when he would have protected the tree with his life but that it should be buried in the past. You should find someone that might know about his past."}
, Summary = ""}
, 
[8062] = {Title = "Kanainne", 
Description = {"\'\'Now El Schatt is just a heartless, money grabbing...! He\'s completely changed. My sister would be rolling in her grave, seeing him now...\'\' - Manainne"}
, Summary = ""}
, 
[8063] = {Title = "Kanainne\'s spirit", 
Description = {"\'\'I... I can borrow my sister\'s body? Yes, if she cooperates, maybe... Maybe it will work. I must... must do something before he... he... he hurts himself even more..."}
, Summary = ""}
, 
[8064] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Please take this order of Fish Cake Soup to my friend Neha. I\'m grateful that she\'s a regular customer."}
, Summary = "Deliver the order to Neha."}
, 
[8065] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Take this next order of Fish Cake Soup to Maewan, another one of my regulars."}
, Summary = "Deliver the order to Maewan."}
, 
[8066] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Please take it to my roommate, Layoma. But... Be careful. She\'s got a thing about punctuality. Just try not to be late..."}
, Summary = "Deliver the order to Layoma."}
, 
[8067] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Quick, take this Fish Paste Soup to Erjan. Um, but be careful, he\'s really nitpicky..."}
, Summary = "Deliver the order to Erjan."}
, 
[8068] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"You\'re late! Don\'t you know this soup isn\'t good if it isn\'t steaming hot? But... I\'ll forgive you... On one condition. Bring me ^FF00001 Whip^000000 with which to lash you. You\'d better hurry, or I won\'t let you off so easily."}
, Summary = "Bring 1 Whip to Neha."}
, 
[8069] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"Argh, but you\'re late! This is your fault, you know that, right? I can forgive you if you help me with my collection. Just bring me 1 Memory Bookmark, alright?\""}
, Summary = "Bring 1 Memory Bookmark to Maewan"}
, 
[8070] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"I can\'t let you continue delivering for Cellette unless you prove to me that you\'re dependable. Erm, bring me ^ff00001 Mushroom Spore^000000, and I\'ll forget this whole thing.\""}
, Summary = "Bring 1 Mushroom Spore to Layoma."}
, 
[8071] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"Hmm, but as the first son of the Franchesfeschu family, I cannot eat this soup unless it is suitably prepared. Go! I command you to bring me the commoner\'s ^ff0000China^000000!\""}
, Summary = "Bring Erjan 1 China."}
, 
[8072] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"Ooh, did I accidentally whip you twice? Heh heh... Well, I\'m satisfied. I\'ll go ahead and tell Cellette that you did a good job... I hope you come deliver my soup again!\""}
, Summary = "Return to Cellette."}
, 
[8073] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"Great, you really brought me a Memory Bookmark! Yes, this will make a fine addition to my collection! Oh, and give me my soup. Thanks again for delivering!\""}
, Summary = "Return to Cellette."}
, 
[8074] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"Alright, maybe I can count on you to work for my roommate Cellette a little while longer. Oh, and please tell her not to come home so late all the time, okay?\""}
, Summary = "Return to Cellette."}
, 
[8075] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"\"You are dismissed. Please take your leave, and return to Cellette with my noble thanks.\""}
, Summary = "Return to Cellette."}
, 
[8076] = {Title = "Klitzer and Calla", 
Description = {"I know I\'m acting like a complete idiot. But I\'d give anything to see Calla... Just don\'t listen to anything I say. I\'m just a poor fool in love with the wrong person. That has to be it...."}
, Summary = " "}
, 
[8077] = {Title = "Klitzer and Calla", 
Description = {"Well, maybe I can\'t see him, but would you give my violin to Klitzer for me? I used to play this for him all the time..."}
, Summary = "Take Calla\'s Violin to Klitzer."}
, 
[8078] = {Title = "Klitzer and Calla", 
Description = {"That\'s my daughter\'s violin. I gave that to her for her sweet sixteen... You\'ve crossed the line, punk! Guards! Get over here!"}
, Summary = "Calla\'s Violin is taken away."}
, 
[8079] = {Title = "Klitzer and Calla", 
Description = {"All you need to do is just give her ^FF00001 Flower^000000. I don\'t have the Zeny, and I don\'t think I\'m welcome at Kapellthaine Manor."}
, Summary = "Bring 1 Flower to Calla."}
, 
[8080] = {Title = "Klitzer and Calla", 
Description = {"Oh, if you pass by Einbroch, would you thank Klitzer for the flower for me please? A-and... And... Please tell him that I really miss him a lot."}
, Summary = "Deliver Calla\'s message to Klitzer."}
, 
[8081] = {Title = "Klitzer and Calla", 
Description = {"I feel so much better now. Oh! When you have the time, why don\'t you talk to my mother? She always likes meeting my friends."}
, Summary = "Meet Klitzer\'s mother."}
, 
[8082] = {Title = "Klitzer and Calla", 
Description = {"I can\'t bear to see the petty hatred between our two towns stop my son from seeing the woman he loves... Find someone who may know of the history of Einbroch and Einbech."}
, Summary = " "}
, 
[8083] = {Title = "Klitzer and Calla", 
Description = {"Why don\'t you bring me ^990000Coal^000000? It\'s not impossible for someone like yourself, but this kind of task will require some effort on your part."}
, Summary = "Bring Coal to Satra."}
, 
[8084] = {Title = "Klitzer and Calla", 
Description = {"Well, I shall try to find some use for these. I\'m afraid the gift I\'ve asked from you isn\'t very practical. How is Coal usually used? Ah, I have a novel idea! It seems that bringing Coal will get Satra to talk."}
, Summary = "Bring more Coal to Satra."}
, 
[8085] = {Title = "Klitzer and Calla", 
Description = {"Anyway, when you next meet Klitzer, please tell him to pay me a visit soon. Oh, and remind him to dress appropriately for this special occasion. Ho ho ho ho ho!"}
, Summary = "Deliver the message to Klitzer."}
, 
[8086] = {Title = "Klitzer and Calla", 
Description = {"Eh...?  What did you just say? Did you just say that Calla\'s mother wants me to have tea with her? Holy moley...!!"}
, Summary = " "}
, 
[8087] = {Title = "Klitzer and Calla", 
Description = {"Thank you for helping my son, Klitzer. Sadly, the little fool doesn\'t have a clue when it comes to certain things like choosing clothing. A man should wear nice clothes, like a Formal Suit or a Tuxedo, for important meetings and special occasions. "}
, Summary = "Get Klitzer a nice outfit."}
, 
[8088] = {Title = "Klitzer and Calla", 
Description = {"You\'ve really opened my eyes. From now on, I\'ll do my best to earn the approval of Calla\'s parents and become worthy of Calla\'s love."}
, Summary = " "}
, 
[8089] = {Title = "Stolen Gemstone", 
Description = {"I don\'t have any proof, but I suspect it was stolen by Phobe, a servant that disappeared about the same time the gem disappeared. You might want to question the other servants of his whereabouts."}
, Summary = "Get some information on Phobe\'s whereabouts."}
, 
[8090] = {Title = "Mr. Manson", 
Description = {"Truth be told, I don\'t know much since I just started working here. Why don\'t you ask the senior employees? You could ask Mr. Manson inside the mansion."}
, Summary = "Find Mr. Manson."}
, 
[8091] = {Title = "Jenny the gardener", 
Description = {"Ah, our gardener Jenny was the one that introduced me to him. She\'s worked for Sir Zhed for a long time, and she loves kids. You know, if you want to know more about that kid, you should talk to Jenny."}
, Summary = "Find Jenny."}
, 
[8092] = {Title = "Searching the Market", 
Description = {"Alright, I guess I can go to the market and ask around."}
, Summary = "Go to the Market."}
, 
[8093] = {Title = "Mysterious Message", 
Description = {"So yeah, last night, some guy asked me to tell anyone looking for this guy named Phobe to give you a message. Basically, he wants you to come to the \'Ice Cave.\' Let\'s see, his name was... Nogan? Rogan? Something like that."}
, Summary = "Go to the Ice Cave."}
, 
[8094] = {Title = "Double Crossed?", 
Description = {"Vincent\'s instructions were to kill anyone that asked about Rogan, some name he made up. It looks like he set us up, dude. Sorry, if I had known, I wouldn\'t have done it."}
, Summary = "Go back to Vincent."}
, 
[8095] = {Title = "Find Phobe", 
Description = {"You won\'t get in trouble if I can find the jewel and Phobe before Sir Zhed returns, so I\'ll try to find them for you as soon as I can. Phobe is just a kid, so he\'s probably hiding somewhere in town..."}
, Summary = "Try finding Phobe."}
, 
[8096] = {Title = "Stolen Gemstone Found", 
Description = {"Just so you know, I don\'t plan on going back home! Well, just not this second anyway. But let my mom know that I\'m fine and not to worry."}
, Summary = "Go back to Vincent."}
, 
[8097] = {Title = "Informing Jenny", 
Description = {"While I return this jewel, would you please tell my wife, Jenny, that our boy is okay? She\'s been very worried about him, so..."}
, Summary = "Jenny."}
, 
[8098] = {Title = "Keeping the Secret", 
Description = {"Thank you for all your help, Adventurer!"}
, Summary = "Go back to Vincent."}
, 
[8099] = {Title = "Vincent\'s Recommendation", 
Description = {"This note is a letter of recommendation that I have written for you. Please deliver it to Sir Zhed as soon as possible. Goodbye, and thanks for everything."}
, Summary = "Go see Sir Zhed."}
, 
[8100] = {Title = "Recommendation from High Priest Zhed", 
Description = {"While I finish writing this recommendation, let me tell you how to get to the Pope\'s office where you must go once you gather 40 Glacial Hearts."}
, Summary = "Gather 40 Glacial Hearts and go see the Pope."}
, 
[8101] = {Title = "Recommendation from High Priest Zhed", 
Description = {"I really want to thank you for coming to speak to me. I had a great time learning. Now I have to go officiate services, so... This is goodbye for now..."}
, Summary = "Go back to Zhed."}
, 
[8102] = {Title = "Recommendation from High Priest Zhed", 
Description = {"I\'m sorry, but we\'re not quite finished with our discussion. Why don\'t you wait and relax in the next room over there in the meantime?"}
, Summary = " "}
, 
[8103] = {Title = "Recommendation from High Priest Zhed", 
Description = {"I want to give you a bit of advice. Don\'t get too close to High Priest Zhed. If you do, you might end up getting yourself in trouble..."}
, Summary = "Go back to Zhed."}
, 
[8104] = {Title = "Recommendation from High Priest Zhed", 
Description = {"Ah, but before you go, let me warn you not to ^FF0000go near the Holy Ground^000000. I repeat, stay away from the Holy Ground."}
, Summary = " "}
, 
[8105] = {Title = "Recommendation from High Priest Zhed", 
Description = {"I warned Bekento that he might cause trouble for you, but it seems that you\'ve caused trouble for him. Understand this: most intruders are severely punished, but because of my friendship with Bekento, I\'m letting you off easy. Remember that..."}
, Summary = "Go back to Zhed."}
, 
[8106] = {Title = "Mr. Shendar\'s daughter", 
Description = {"Mr. Shendar says that his daughter has been going out with someone. She went to some town for that boy and he hasn\'t heard from her since. Find someone who might know what may have happened to her."}
, Summary = ""}
, 
[8107] = {Title = "Lachellen\'s Testimony", 
Description = {"Ooh, I\'m so jealous of Bruspetti! She\'s been spending so much time with her new boyfriend recently... But she still refuses to tell me what his name is. Let\'s see... He grew up in Lighthalzen? That\'s all she knows."}
, Summary = "Find a foreigner in town."}
, 
[8108] = {Title = "A Foreigner, Katinshuell", 
Description = {"Katinshuell told you that he and his girlfriend\'s relationship is over. Maybe he is talking about Mr. Shendar\'s daughter. You should ask him about it."}
, Summary = "Speak to Mr. Shendar."}
, 
[8109] = {Title = "Bruspetti\'s scent", 
Description = {"Mr. Shendar says that his daughter, Bruspetti, has a distinct, pleasant scent like her mother. You should search for someone with a distinct, pleasant scent in Lighthalzen."}
, Summary = "Search for Bruspetti\'s scent in Lighthalzen."}
, 
[8110] = {Title = "Bruspetti\'s scent", 
Description = {"This... This smell... It smells so nice! Like rose petals riding on a gentle breeze... Wait, could this be the scent that Bruspetti\'s father mentioned earlier?"}
, Summary = "Go back to Rachel and meet Lachellen."}
, 
[8111] = {Title = "Lachellen\'s Testimony", 
Description = {"If she\'s in Lighthalzen, she\'s probably gone there to learn more about her boyfriend. Hmm, maybe if you check the place where she and her boyfriend usually went on dates, you might be able to find something."}
, Summary = "Find Freya\'s Spring."}
, 
[8112] = {Title = "Freya\'s Spring", 
Description = {"I\'m sorry if I startled you, but the ground that you\'re standing on is very slippery, you know."}
, Summary = "Go back to Mr. Shendar."}
, 
[8113] = {Title = "Bruspetti\'s Diary", 
Description = {"As a loving father, I can\'t allow myself to invade my precious daughter\'s privacy. Even if she did carelessly leave her diary on top of her drawer."}
, Summary = "Search for the diary on top of the drawer."}
, 
[8114] = {Title = "Bruspetti\'s Diary", 
Description = {"This must be Bruspetti\'s diary! But... reading it would make you feel like a real creep. You should ask Katinshuell if he knows why Bruspetti is in Lighthalzen."}
, Summary = "Go meet Katinshuell"}
, 
[8115] = {Title = "Suspicious Katinshuell", 
Description = {"Katinshuell insists on being left alone. Maybe someone else will know something else about Bruspetti\'s interest in Freya\'s Spring and Lighthalzen."}
, Summary = "Go meet Lachellen."}
, 
[8116] = {Title = "Lachellen\'s Testimony", 
Description = {"Freya\'s Spring? Oh, I like that place! Speaking of which, I know someone named Katinshuell that went there pretty often. Usually men don\'t go alone..."}
, Summary = "Go to Freya\'s Spring."}
, 
[8117] = {Title = "Freya\'s Spring", 
Description = {"See the edge of the spring? The same young man frequently comes to that spot, and stares into the water, just dripping with sadness. Someone so young shouldn\'t be feeling like that."}
, Summary = "Go back to Mr. Shendar."}
, 
[8118] = {Title = "Conversation with Mr. Shendar", 
Description = {"Wait, wait... So someone has been sneaking around here? That\'s weird. Wait, that guy, the one that might be Bruspetti\'s boyfriend..."}
, Summary = "Retrieve Bruspetti\'s Diary."}
, 
[8119] = {Title = "Bruspetti\'s Diary", 
Description = {"You now have permission to take the diary with you so that you can figure out if Bruspetti and Katinshuell are connected... Bring the diary to Katinshuell."}
, Summary = "Katinshuell"}
, 
[8120] = {Title = "Conversation with Katinshuell", 
Description = {"Tell me the truth! Actually, you know what? Why don\'t we look at the truth together? How\'s that?"}
, Summary = "Keep talking to Katinshuell."}
, 
[8121] = {Title = "Conversation with Katinshuell", 
Description = {"He\'s still resisting me... How can I get him to reveal the truth? Maybe there\'s something I could use to make him confess..."}
, Summary = "Keep talking to Katinshuell."}
, 
[8122] = {Title = "Bruspetti\'s resting place", 
Description = {"... Please just leave me alone. I\'ve lost the woman I love because of something stupid I did in the past. If you want to turn me in, go ahead..."}
, Summary = "Go to Freya\'s Spring."}
, 
[8123] = {Title = "Ayotaya\'s world famous dish, Tom Yum Goong", 
Description = {"Anyone can make Tom Yum Goong, but I recommend that you go visit ^3131FFMali the Spicy^000000. She\'s the best cook. Why don\'t you ask her to cook for you?"}
, Summary = " "}
, 
[8124] = {Title = "Ayotaya\'s world famous dish, Tom Yum Goong", 
Description = {"You can buy the freshest Shrimp from the guy named, \'^3131FFThongpool^000000\'. Get 20 Shrimps to cook Tom Yum Goong."}
, Summary = "Bring 20 shrimps to Mali the Spicy."}
, 
[8125] = {Title = "Ayotaya\'s world famous dish, Tom Yum Goong", 
Description = {"Mali the Spicy has found a very nice lemon tree, however, the lemons were not for sale.  You must get some Lemons from the owner of the lemon tree."}
, Summary = "Bring 10 Lemons to Mali the Spicy."}
, 
[8126] = {Title = "Ayotaya\'s world famous dish, Tom Yum Goong", 
Description = {"Now you must get \'^CE0000Red Chile^000000\' and other materials from the market. Ask the merchant at the market and you\'ll know what materials to get."}
, Summary = "Bring 30 Red Chile and other materials to Mali the Spicy."}
, 
[8127] = {Title = "Momotaro Field Trip", 
Description = {"The Chief said Dokebi earned 20 million Zeny by hacking others\' accounts... Since we towners spend our time sitting and chatting, we can\'t kill Dokebis because we\'re low level, so...Please do it for us."}
, Summary = "Defeat Dokebi"}
, 
[8128] = {Title = "Momotaro Field Trip", 
Description = {"Now, the Momotaro story is over. You can get your reward when you talk to the Publisher lady you saw first."}
, Summary = " "}
, 
[8129] = {Title = "Momotaro Field Trip", 
Description = {"...At this point I\'m supposed to send you back...BUT! I will give you a chance. But if you fail, ^3163FFyou can\'t take this challenge.^000000 Also, this mission will be pretty hard."}
, Summary = "?????? ???????"}
, 
[8130] = {Title = "Momotaro Field Trip", 
Description = {"You are really something. You\'ve got the moves, kiddo. Let me show you the exit. I had a great time...Don\'t forget to get your reward."}
, Summary = " "}
, 
[8131] = {Title = "The mother of lord in Amatsu", 
Description = {"The mother of our lord is resting in here. She has been sick for months. That is why she is staying in here."}
, Summary = " "}
, 
[8132] = {Title = "The mother of lord in Amatsu", 
Description = {"You, who hail from Rune-Midgard, may be able to cure my mother\'s disease. I will reward you well if you succeed. My mother is living in a house outside of the palace. Come to me when you finish your treatment."}
, Summary = "Find the treatment to cure the mother of lord."}
, 
[8133] = {Title = "Song of the fox", 
Description = {"Priest, priest! A fox is following me! He won\'t leave when I scream and shout! The North Shrine Priest should help me out~ Ralralrah Ralralrah Ralralrahralralrah~~"}
, Summary = " "}
, 
[8134] = {Title = "Boy at the Northern Shrine", 
Description = {"A stronger spirit will expel the fox from a human. Come on, yell out and show me your spirit!"}
, Summary = " "}
, 
[8135] = {Title = "Fox Expelled", 
Description = {"^FF6060Yelp! Yelp! Yelp! Human! To expel me from this body like this! Curse you! Darn you!! I will curse the Ishida family, and you\'d better watch out, human!^000000"}
, Summary = "?????? ?????? ???? ??????? ???u???"}
, 
[8136] = {Title = "The Gray Wolf\'s Warning", 
Description = {"You have met a Gray Wolf that warns you about someone named Koshei, the Immortal, and tells you that you should leave this place. But who is this Koshei exactly? Maybe the Gray Wolf will come back and explain himself more..."}
, Summary = ""}
, 
[8137] = {Title = "Finding the Key Maker", 
Description = {"Koshei seems to be an immortal evil being that was sealed away by a girl named Maria. Maria needs to be freed from her stone prison by finding the Key Maker to make the ^0000ffGolden Key^000000."}
, Summary = ""}
, 
[8138] = {Title = "Blacksmith\'s Request", 
Description = {"The Blacksmith has asked you to bring him 25 Steel. He promised that he will explain how to make the \'Golden Key\' after you bring him the Steel."}
, Summary = ""}
, 
[8139] = {Title = "The Golden Key", 
Description = {"The Blacksmith says that you need ^0000ff2 Cursed Ruby, 3 Gold, 1 Red Ring, 2 Lusalka\'s Hair, and 10 Golden Thread^000000 to make the Golden Key. Talk to the Blacksmith and he will tell you how to get the materials. And don\'t forget to wear those Strong Steel Boots."}
, Summary = ""}
, 
[8140] = {Title = "The Red Ring", 
Description = {"Vassili Grandpapa says that he had a Red Ring but that he gave it to his daughter Mashenka who unfortunately passed away. But he has another daughter, named Ryubaba who might know about the Red Ring."}
, Summary = "Ryubaba"}
, 
[8141] = {Title = "Mashenka\'s Red Ring", 
Description = {"Ryubaba tells you that her sister Mashenka was probably wearing the Red Ring when she disappeared around the marsh."}
, Summary = ""}
, 
[8142] = {Title = "Searching the Marsh", 
Description = {"You speak with a Shepherdess near the marsh who asks you to bring her ^0000ff25 Pointed Branches^000000 while you search for Mashenka and her Red Ring."}
, Summary = ""}
, 
[8143] = {Title = "The Flute\'s Voice", 
Description = {"The Shepherdess makes you a Wooden Flute out of the Branches you brought her. A strange voice sings a sad song when it is played. You should ask Ryubaba about the voice that sings with the flute."}
, Summary = ""}
, 
[8144] = {Title = "Ryubaba\'s Confession", 
Description = {"You can\'t live with yourself if you do not tell Vasilli the truth about what happened between his two daughters. Tell him what Ryubaba confessed about Mashenka and bring the Wooden Flute as evidence."}
, Summary = ""}
, 
[8145] = {Title = "Worried Mother\'s Request", 
Description = {"You have met a worried Mother who tells you a story about the water nymph Lusalka who may or may not be her daughter. Continue your conversation with the worried Mother."}
, Summary = ""}
, 
[8146] = {Title = "Finding Lusalka", 
Description = {"In order to find the aqua nymph Lusalka, you must find an area of water between the hours of 5pm and 6am PST and bring Holy Water to protect yourself from her dangerous stare."}
, Summary = ""}
, 
[8147] = {Title = "Lusalka\'s Beloved", 
Description = {"Lusalka has asked you to find her beloved Igor at the capital of the Rune Midgard Kingdom and give him her golden earrings and deliver her message telling him to stop suffering."}
, Summary = ""}
, 
[8148] = {Title = "Lusalka\'s Beloved", 
Description = {"You find a wanderer from Moscovia who travelled to Prontera with Igor but they have since parted ways. He said that Igor was headed for a desert... The nearest desert you know of is..."}
, Summary = ""}
, 
[8149] = {Title = "Searching for Igor", 
Description = {"A villager in Morroc says that he may have seen Igor and that he went into the Pyramid. Maybe you have finally tracked him down so you can deliver Lusalka\'s golden earrings to him."}
, Summary = ""}
, 
[8150] = {Title = "Igor\'s message", 
Description = {"Igor asks you to go to Lusalka and tell her that he still loves her. Maybe now she will agree to give you her hair so you can make the Golden Key. Remember to bring a \'Holy Water\' when you talk to Lusalka to protect yourself from her stare."}
, Summary = ""}
, 
[8151] = {Title = "Marozka\'s Cave", 
Description = {"Marozka says that he needs to test your worthiness to fight against Koshei. Bring him 100 Well Baked Cookies from the Stone Furnace and 100 Apples from the Apple Tree in his cave."}
, Summary = ""}
, 
[8152] = {Title = "The Golden Thread", 
Description = {"You have brought the cookies and apples to Marozka. He says that making the Golden Thread will take him a while to make. Come back in one hour and he will surely have it ready."}
, Summary = ""}
, 
[8153] = {Title = "Test of mind and wisdom", 
Description = {"You must pass all of Marozka\'s tests and he will give you the Golden Thread that he just made."}
, Summary = ""}
, 
[8154] = {Title = "The Key Maker", 
Description = {"The key maker is in a cabin deep inside the forest. Beware of the key maker\'s words and don\'t forget the blacksmith\'s protection spell, \'^0000ffSpellshield Protection^000000.\'"}
, Summary = ""}
, 
[8155] = {Title = "Baba Yaga\'s Favor", 
Description = {"Baba Yaga has asked you to do her the favor of finding her cow that ran away, which you must find and cast a return spell on. The spell is \'^ff0000Good feed is orange-flavored^000000\'."}
, Summary = ""}
, 
[8156] = {Title = "Baba Yaga\'s Favor", 
Description = {"You have cast the return spell on Baba Yaga\'s cow. Return it to her and let her know that you have done the favor she asked you to do."}
, Summary = ""}
, 
[8157] = {Title = "Baba Yaga\'s Favor", 
Description = {"Baba Yaga has asked you to do her a favor and find a way to quieten down a noisy coffin behind her house in exchange for her making the Golden Key for you."}
, Summary = ""}
, 
[8158] = {Title = "Baba Yaga\'s Favor", 
Description = {"You have managed to quieten down the noisy coffin behind Baba Yaga\'s house. Return it to her and let her know that you have done the favor she asked you to do."}
, Summary = ""}
, 
[8159] = {Title = "Baba Yaga\'s Favor", 
Description = {"Baba Yaga has asked you to do her a favor and bring back her precious Silver Spoon which pirates in a sunken ship stole from her in exchange for her making the Golden Key for you."}
, Summary = ""}
, 
[8160] = {Title = "Baba Yaga\'s Favor", 
Description = {"You have found Baba Yaga\'s Silver Spoon that the pirates stole from her. Return it to her and let her know that you have done the favor she asked you to do."}
, Summary = ""}
, 
[8161] = {Title = "Baba Yaga\'s Favor", 
Description = {"Baba Yaga has asked you to do her a favor by buying her a magic book from Momotaro in Amatsu. It is reserved under her name so all you have to do is go there and buy it for her."}
, Summary = ""}
, 
[8162] = {Title = "Baba Yaga\'s Favor", 
Description = {"You have bought the magic book and given it to Baba Yaga. Talk to her again to see if she has finished making the Golden Key."}
, Summary = ""}
, 
[8163] = {Title = "Baba Yaga\'s Favor", 
Description = {"Baba Yaga has asked you to do her a favor and find a way to quieten the house ghost living in a jar next to her cabin in exchange for her making the Golden Key for you."}
, Summary = ""}
, 
[8164] = {Title = "Baba Yaga\'s Favor", 
Description = {"After playing a card game with the house ghost, it promises that it will be quiet now. Return to Baba Yaga and let her know that you have done the favor she asked you to do."}
, Summary = ""}
, 
[8165] = {Title = "Baba Yaga\'s Favor", 
Description = {"Baba Yaga has asked you to do her a favor and go to Broom Grandmother in Payon and buy her a broom in exchange for her making the Golden Key for you."}
, Summary = ""}
, 
[8166] = {Title = "Baba Yaga\'s Favor", 
Description = {"After playing dice with the ghost tree you have finally received the Broom that Baba Yaga asked you to get. Return to Baba Yaga and let her know that you have done the favor she asked you to do."}
, Summary = ""}
, 
[8167] = {Title = "The Golden Key", 
Description = {"You have finally received the Golden Key from Baba Yaga. Now it\'s time to free Maria Morebna from her imprisonment inside that wall."}
, Summary = ""}
, 
[8168] = {Title = "Koshei, the Immortal", 
Description = {"Gray Wolf will take care of Maria\'s wounds. You must do what you can to subdue Koshei."}
, Summary = ""}
, 
[8169] = {Title = "Living and Dead Water", 
Description = {"Gray Wolf says that you can save Maria if you get \'Life Water\' and \'Death Water\' from Baba Yaga."}
, Summary = ""}
, 
[8170] = {Title = "Living and Dead Water", 
Description = {"In order to make the \'Living Water\' you need to bring 1 Holy Water and 2 Yggdrasil Leaves and for the \'Dead Water\' you need to bring 1 Cursed Water and 10 Hinalle Leaflets."}
, Summary = ""}
, 
[8171] = {Title = "Living and Dead Water", 
Description = {"Baba Yaga has given you the \'Living Water\' and \'Dead Water\'. Go to Maria quickly. You must first pour the \'Dead Water\' to remove the wound and curses and then pour the \'Living Water\' to bring her spirit back."}
, Summary = ""}
, 
[8181] = {Title = "Sight Blaster", 
Description = {"This skill sounds easy but it\'s pretty hard to learn. Knights are experts with skills that push enemies back, so go and find one who\'ll explain Push Back theory to you in Prontera. Check the 11 o\' clock direction on your Mini-Map."}
, Summary = " "}
, 
[8182] = {Title = "Push Back Theory", 
Description = {"Well, I\'ve explained pushing as best as I can. Concentrate and practice the theory on your own, and you should be able to do it."}
, Summary = "Go back to Meow"}
, 
[8183] = {Title = "Sight Blaster", 
Description = {"I\'m no philanthropist, so I expect some tuition for all of my instruction and bother! Go and bring me ^ff000010 Crystal Blues, 10 Green Lives, 10 Red Bloods, 10 Winds of Verdure^000000!"}
, Summary = "Bring the materials to Meow."}
, 
[8184] = {Title = "Elemental Converter", 
Description = {"Please bring the required materials so that we can construct a basic elemental converter. You need ^ff00007 Horns, 12 Rainbow Shells, 10 Snail\'s Shells, 4 Blank Scrolls, 10 Scorpion Tails^000000."}
, Summary = "Return to Mishuna with the materials."}
, 
[8185] = {Title = "Elemental Change", 
Description = {"Now you\'re ready to learn the other skill, ^ff0000Elemental Change^000000....I need to prepare a few things for this lesson, so we\'ll meet and discuss this later, okay?"}
, Summary = " "}
, 
[8186] = {Title = "Fire Elemental Change", 
Description = {"Please bring ^ff000020 Red Bloods, 1 Payon Solution, 1 Morroc Solution^000000, then you\'ll be able to learn ^ff0000Fire Elemental Change^000000."}
, Summary = "Return to Mishuna with the materials."}
, 
[8187] = {Title = "Earth Elemental Change", 
Description = {"Please bring ^ff000020 Green Lives, 1 Payon Solution, 1 Morroc Solution^000000, then you\'ll be able to learn ^ff0000Earth Elemental Change^000000."}
, Summary = "Return to Mishuna with the materials."}
, 
[8188] = {Title = "Wind Elemental Change", 
Description = {"Please bring ^ff000020 Winds of Verdure, 1 Payon Solution, 1 Morroc Solution^000000, then you\'ll be able to learn ^ff0000Wind Elemental Change^000000."}
, Summary = "Return to Mishuna with the materials."}
, 
[8189] = {Title = "Water Elemental Change", 
Description = {"Please bring ^ff000020 Crystal Blues, 1 Payon Solution, 1 Morroc Solution^000000, then you\'ll be able to learn ^ff0000Water Elemental Change^000000."}
, Summary = "Return to Mishuna with the materials."}
, 
[8190] = {Title = "Charming Wink", 
Description = {"You must bring me ^FF00001 Crystal Mirror^0000000! This tool is imperative to the lesson, so fetch it and bring it to me quickly!"}
, Summary = "Bring 1 Crystal Mirror to Canell."}
, 
[8191] = {Title = "Charming Advisor", 
Description = {"Now that you\'ve established the proper attitude to beauty, it\'s time for you to learn an advanced technique of enticement. Go and find my sister in Prontera Chruch. She\'ll be willing to teach you."}
, Summary = " "}
, 
[8192] = {Title = "Selfish Advisor", 
Description = {"I want to have a real drink, something ^FF0000alcoholic^000000. Oh, and I need some snacks to sustain all of my teaching energy! ^FF00001 Apple, 3 Bananas, 5 Well-Baked Cookies^000000 placed on some fine ^FF0000China^000000."}
, Summary = "Return to Aelle with an alcoholic drink and the side dish."}
, 
[8193] = {Title = "Selfish Advisor", 
Description = {"Now, the easiest, most subtle and most appealing gesture of all time is the ^FF0000wink^000000. It\'s saved me in times of crisis, and mastering it will enhance your charms."}
, Summary = " "}
, 
[8194] = {Title = "Drunken Advisor", 
Description = {"G-go away. Talk to Canell, my sister...!..ZzzzzZzZZZzzzZZ.."}
, Summary = " "}
, 
[8195] = {Title = "Kind Canell", 
Description = {"Now, a true dancer should be able to figure out the secret to winking on her own. But since I\'m such a kind woman, I will deign to explain it to you. Ho-ho!"}
, Summary = " "}
, 
[8196] = {Title = "The Tripartite Union\'s Feud", 
Description = {"\"Those researchers complain a lot these days. They\'re terribly stressed out and I think somebody should really listen to their problems. Particularly those dealing with document files who argue with each other all the time. You might wanna start by talking to them.\""}
, Summary = " "}
, 
[8197] = {Title = "Document Delivery", 
Description = {"\"Ok, now, please deliver the file to Hue and Hansenne. Hue\'s in charge of Schwartzvald documents, and Hansenne\'s in charge of Arunafeltz\'. You should go see Hue at the Schwartzvald office, otherwise, he\'ll be whining about it.\""}
, Summary = "Deliver the documents to Hue and Hansenne and return to Ryosen."}
, 
[8198] = {Title = "Report to the United Research Official", 
Description = {"\"Well, it\'s already spilled water. I need to go to that meeting whether I like it or not. Could you please send this to the Official of the United Research? In the mean time, I should prepare myself for the meeting.\""}
, Summary = "Deliver the documents to the United Research Official."}
, 
[8199] = {Title = "United Research Official\'s Favor", 
Description = {"\"Please, you should participate in the meeting and mediate for them if anything goes wrong! First, you should go meet those 3 people and check with them about preparing for the meeting. Hope they\'re not preparing any weapons, though.\""}
, Summary = " "}
, 
[8200] = {Title = "Ryosen\'s Document Requests", 
Description = {"\"I\'ve requested something from the Arunafeltz office but haven\'t got anything yet. Could you get it from Hansenne? I need that for the meeting but he never sends it to me. He must\'ve forgotten about it, again!\""}
, Summary = " "}
, 
[8201] = {Title = "Missing Document", 
Description = {"\"I lost it. I think I might have dropped it into the river or something when I played treasure-hunt on a bridge! But then, those pussy cats to the south-west can teach us to fish, you know. Maybe we can fish that document out of the river!\""}
, Summary = "Go back to Hansenne with the document you caught."}
, 
[8202] = {Title = "Document Restoration", 
Description = {"\"Schwartzwald people have a talent for restoring things like this... Why don\'t you ask Hue to restore it? He\'d scream so loud that the windows might break.\""}
, Summary = " "}
, 
[8203] = {Title = "Document Restoration", 
Description = {"\"It\'s completely soaked. I should dry this thing first and iron these crumples. Then, I should restore the texts. I need some materials. You gotta help me with this. I need ^0000ff1 Folding Fan of Cat Ghost, 1 Old Frying Pan, 1 Flame Stone, 1 Squid Ink^000000.\""}
, Summary = "Bring 1 Folding Fan of Cat Ghost, 1 Old Frying Pan, 1 Flame Stone, 1 Squid Ink"}
, 
[8204] = {Title = "Ryosen", 
Description = {"\"The binding was too loose, so I re-arranged and bound the file all over. Please, deliver this file before it\'s too late.\""}
, Summary = " "}
, 
[8205] = {Title = "Report to the United Research Official", 
Description = {"\"Could you please ask the official to wait for me a bit? I have to find another document for the meeting.\""}
, Summary = " "}
, 
[8206] = {Title = "Researchers\' Meeting", 
Description = {"Participate in the meeting"}
, Summary = " "}
, 
[8207] = {Title = "Hansenne is not guilty.", 
Description = {"\"All I wanted was to let those people get close to each other, become more friendly... But, problems come up all the time. Can you think of a way to get those people to get along with each other?\""}
, Summary = " "}
, 
[8208] = {Title = "Hansenne\'s Favor", 
Description = {"\"He\'ll be okay soon. He\'ll get to thinking that it wasn\'t actually a big deal. But the thing is that... the relationship between Ryosen and Hue isn\'t looking good at all. Why don\'t you help them get along with each other?\""}
, Summary = " "}
, 
[8209] = {Title = "Hue\'s Report", 
Description = {"\"Here, this is the Rune-Midgard report I took with me when everything went wrong in the meeting room. Could you please give this to Ryosen?\""}
, Summary = " "}
, 
[8210] = {Title = "Report to the United Research Official", 
Description = {"\"Okay. I should set up another meeting asap. Could you go see the official instead of me and set up a meeting?\""}
, Summary = " "}
, 
[8211] = {Title = "Shurank\'s Lecture", 
Description = {"\"Have you been learning the art of using Bash? I fervently believe that the Bash skill is the essence of swordsmanship!\""}
, Summary = "Master the Bash skill and return to Shurank."}
, 
[8212] = {Title = "Shurank\'s Lecture", 
Description = {"\"I see that you understand a little bit about the Bash skill. But still, it\'s not enough.\""}
, Summary = "Master the Bash skill and return to Shurank."}
, 
[8213] = {Title = "Shurank\'s Lecture", 
Description = {"\"I see that you\'ve gained some proficiency with the Bash skill. But still, it\'s not enough.\""}
, Summary = "Master the Bash skill and return to Shurank."}
, 
[8214] = {Title = "Shurank\'s Lecture", 
Description = {"\"Those calluses...! Only a master of the Bash skill has those kinds of hands. Great work, Swordsman. I\'m very impressed.\""}
, Summary = "Listen to Shurank\'s Lecture"}
, 
[8215] = {Title = "Shurank\'s Lecture", 
Description = {"\"By now, I believe that you know enough about the Increase HP Recovery skill. Next time, I shall teach you what I know about the Provoke skill.\""}
, Summary = "Listen to Shurank\'s Lecture"}
, 
[8216] = {Title = "Shurank\'s Order", 
Description = {"\"I wish for you to find a Knight named ^5D478BDequ\'ee^000000 in ^5D478BGeffen^000000. Listen carefully, this is the message: ^0000FFWhat happened to the murderer?^000000 ^0000FFDid you find out who he is? If you did, what are we supposed to do now?^000000\""}
, Summary = "Deliver Shurank\'s message to Dequ\'ee in Geffen"}
, 
[8217] = {Title = "Dequ\'ee?? Message", 
Description = {"\"So Shurank is asking, \'What happened to the murderer? Did you find out who he is? If you did, what are we supposed to do now?\' We haven\'t found out who the murderer is for sure. However, we have a list of suspects and we\'ll figure it out soon."}
, Summary = "Deliver Dequ\'ee\'s message to Shurank in Izlude"}
, 
[8218] = {Title = "Shurank\'s Lecture", 
Description = {"You haven\'t learned Provoke yet? Now I ask that you train yourself in the use of Provoke."}
, Summary = "Master the Provoke skill and return to Shurank."}
, 
[8219] = {Title = "Shurank\'s Lecture", 
Description = {"\"Hmm. You seem to have a basic understanding of Provoke, but let me give you a few details so that you can better understand the use of this skill.\""}
, Summary = "Master the Provoke skill and return to Shurank."}
, 
[8220] = {Title = "Shurank\'s Lecture", 
Description = {"\"Ah, I see that you have a fairly good understanding of the Provoke skill. Next time we speak, I will tell you what I know about the ^5D478BEndure^000000 skill. When you\'re ready to learn, come back to me.\""}
, Summary = "Listen to Shurank\'s Lecture"}
, 
[8221] = {Title = "Shurank\'s Lecture", 
Description = {"\"Activating Endure enables you to shrug off attacks. You\'ll receive damage, but enemy attacks will not impede you as much. This means you can counter enemy attacks or escape if you need to. Alright. Now I want you to train in the use of the Endure skill. You can become a great swordsman.\""}
, Summary = "Master the Endure skill and return to Shurank"}
, 
[8222] = {Title = "Shurank\'s order", 
Description = {"\"Ah, once again, I have another task for you to perform. Please visit Dequ\'ee in Geffen since it seems he has something to ask of you. Hurry and meet with Dequ\'ee and return to me when you complete whatever it is that he wishes for you to do.\""}
, Summary = "Go to Dequ\'ee."}
, 
[8223] = {Title = "Dequ\'ee\'s order", 
Description = {"\"Now, I want you to go to Morroc and interrogate four suspects. Their names are ^5D478BMuetro^000000, ^5D478BGeil^000000, ^5D478BHans,^000000 and ^5D478BBankley^000000. It shouldn\'t be too difficult. After you speak to all of them, come back and report to me.\""}
, Summary = "Return to Dequ\'ee after finding the evidence in Morocc."}
, 
[8224] = {Title = "The clue", 
Description = {"TheisWesomeof...Alright, great. Now all we have to do is figure out what all of this means. This is going to be really difficult. We\'ll have to figure it out, it\'s the only clue that we have...."}
, Summary = " "}
, 
[8225] = {Title = "Dequ\'ee\'s Reasoning", 
Description = {"\"Alright! It looks like Bankley is the murderer! Although we can\'t trust this 100%, the evidence is pretty conclusive. Hurry over to Morroc and monitor Bankley in case he does anything desperate. If something happens, report to me right away!\""}
, Summary = "Watch Bankley closely in Morocc."}
, 
[8226] = {Title = "Bankley\'s Death", 
Description = {"-He\'s dead!  Bankley had a sad, pitiable expression on his face. Since the color is still fresh in his cheeks, he died only a short while ago. There is a long, deep wound in his chest, and a blood-drenched knife is clenched in his right hand.-"}
, Summary = "Report Bankley\'s Death to Dequ\'ee."}
, 
[8227] = {Title = "Return to Shurank", 
Description = {"\"Suicide...? Something shady is going on here! As for the other three suspects, I\'ll make sure that they\'re monitored by members of the Swordsman Association. It looks like this case is closed for now. Once again, thanks for your help. Why don\'t you report back to Shurank now? I guess he still wants to show you the ropes of swordsmanship.\""}
, Summary = "Return to Shurank"}
, 
[8228] = {Title = "Shurank\'s Lecture", 
Description = {"\"This will be my final lecture to you. Please listen carefully as I tell you all about Magnum Break.\""}
, Summary = "Listen to Shurank\'s Lecture"}
, 
[8229] = {Title = "Guarnien\'s Lecture", 
Description = {"\"You can\'t really be a Merchant if you can\'t even carry around goods to sell. Increase Weight Limit skill up to Level 4. After that, we can talk more about becoming a true Merchant.\""}
, Summary = "Return to Guarnien after mastering the Increase Weight Limit skill."}
, 
[8230] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Item Appraisal?? I\'ll talk about the Mammonite skill, it\'s just as basic a skill as Item Appraisal. For now, let me take a little bit of a break from all of this arduous lecturing.\""}
, Summary = "Listen to Guarnien\'s Lecture"}
, 
[8231] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Now, I was going to tell you about the ^FF0000Discount^000000 skill, right?\""}
, Summary = "Listen to Guarnien\'s Lecture"}
, 
[8232] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Alright! Now, in order to get closer to becoming a true Merchant, I want you to learn the Discount skill up to Level 4.\""}
, Summary = "Return to Guarnien after mastering the Discount skill."}
, 
[8233] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Alright, my next lesson will hopefully offer you a bit more of a challenge. Come back when you think you\'re ready, alright?\""}
, Summary = "Listen to Guarnien\'s Lecture"}
, 
[8234] = {Title = "Prontera Market Research", 
Description = {"\"You\'ll find some NPCs selling 10 Red Potions in Prontera. Your task is to buy the potions for the cheapest price.\""}
, Summary = "Buy 10 bottles of the cheapest Red Potion in Prontera and return to Guarnien"}
, 
[8235] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Let me tell you about ^871F78Over Charge^000000.\""}
, Summary = "Listen to Guarnien\'s Lecture"}
, 
[8236] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Like Discount, Over Charge is a passive skill that can be mastered at Skill Level 10. Personally, I think you should learn this skill for sure! For your next assignment, learn Over Charge up to Level 4. It shouldn\'t be too difficult to do.\""}
, Summary = "Return to Guarnien after mastering the Over Charge skill."}
, 
[8237] = {Title = "Guarnien\'s Lecture", 
Description = {"\"Push Cart skill. Be ready for this lecture, as Push Cart is one of the more important skills for a Merchant.\""}
, Summary = "Listen to Guarnien\'s Lecture"}
, 
[8238] = {Title = "Guarnien\'s Lecture", 
Description = {"\"First off, you need to know Level 5 Increase Weight Limit before you can even learn the Push Cart skill. As you can see, this skill is an advanced form of the Increase Weight Limit skill. You can procure a PushCart from most Kafra Ladies for a certain fee. For now, why don\'t you learn the Push Cart skill up to Level 4?\""}
, Summary = "Return to Guarnien after mastering the Cart Skill."}
, 
[8239] = {Title = "Guarnien\'s Lecture", 
Description = {"\"I believe it\'s time for my final lecture. I\'ll discuss the definitive skill of the Merchant: ^871F78Vending^000000.\""}
, Summary = "Listen to Guarnien\'s Lecture"}
, 
[8240] = {Title = "Guarnien\'s Lecture", 
Description = {"\"For your final assignment, I will ask you to learn the Vending skill up to Skill Level 4. Of course, once you do, I\'ll give you a small reward. I\'ll be waiting, so do your best!\""}
, Summary = "Return to Guarnien after mastering the Vending skill."}
, 
[8241] = {Title = "Collection of Red Jewel", 
Description = {"You collect a Red Jewel from a grave which stores voice on it!"}
, Summary = "You bring the stone to a magic scholar in Ash-Vacuum in Rune-Midgard."}
, 
[8242] = {Title = "Collection of Blue Jewel", 
Description = {"You collect a Blue Jewel which stores voice on it from a grave."}
, Summary = "You bring the stone to a magic scholar in Ash-Vacuum in Rune-Midgard."}
, 
[8243] = {Title = "Learning new languages", 
Description = {"The three kingdoms are working together to investigate the languages spoken by the people in Ash Vacuum. Seek out ^0000ffthe language scholar of Arunafeltz^000000."}
, Summary = " "}
, 
[8244] = {Title = "Fairies and Tree Giants", 
Description = {"Find samples of the languages spoken by the fairies and tree giants and then let the Linguist Dictionary know what they\'re saying exactly."}
, Summary = "Report back to the language scholar of Arunafeltz."}
, 
[8245] = {Title = "Language sample investigation", 
Description = {"Find the Rune-Midgard magician wandering inside the Expedition Camp."}
, Summary = ""}
, 
[8246] = {Title = "Language sample investigation", 
Description = {"Did you meet with the two new races? Assassins buried jewels around there. But be careful when you collect them, as they have some traps set on them."}
, Summary = "Find the jewels and bring them back to the Rune-Midgard Magician."}
, 
[8247] = {Title = "Research progress", 
Description = {"I will forward the extracted voice from the jewels to the language scholar of Arunafeltz. If you are not that busy, can you check the language scholar\'s research progress."}
, Summary = ""}
, 
[8248] = {Title = "Research progress", 
Description = {"Just how are we going to put together all this tremendous amount of data and make it into a portable translator...? Can you ask the Mechanic Engineer from Schwartzwald for his opinion?"}
, Summary = ""}
, 
[8249] = {Title = "Compressing Information", 
Description = {"Go back to the Rune-Midgard Magician and see if he knows how to compress information using his magic."}
, Summary = ""}
, 
[8250] = {Title = "Storage Gem", 
Description = {"Outside of Ash-Vacuum, there are some ^0000ffvery mysterious stones not found in the Midgard kingdom^000000. Can you bring me one of them?"}
, Summary = "Find an Unidentified Mineral and bring it back to Magician Whisper."}
, 
[8251] = {Title = "Injection of Magic", 
Description = {"Please wait for a while as Magician Whisper works with the jewel."}
, Summary = ""}
, 
[8252] = {Title = "Handworked jewels", 
Description = {"This is the last request. Please bring this worked jewel to the Mechanical Engineer from Schwartzwald."}
, Summary = ""}
, 
[8253] = {Title = "Language translation device", 
Description = {"I need to make a device that can read the magic code of the jewels. It should only take me an hour to finish making it."}
, Summary = "Come back in an hour."}
, 
[8254] = {Title = "Job Change to Ranger", 
Description = {"Before changing your job, you need to purify your body and mind by making your weight equal \'0\'."}
, Summary = "Make your weight \'0\' and then go to Instructor Rescue."}
, 
[8255] = {Title = "Job Change to Ranger", 
Description = {"It\'s time to test your power to receive your first qualification."}
, Summary = "Talk to Rescue to start the survival power test."}
, 
[8256] = {Title = "Job Change to Ranger", 
Description = {"Head towards the northwestern area of Turtle Island and find Test Instructor Teardrop."}
, Summary = ""}
, 
[8257] = {Title = "Job Change to Ranger", 
Description = {"Get one ^0000ffDragon Tail^000000, and bring 1 Wing of Dragonfly^000000 and bring them back to Test Instructor Teardrop."}
, Summary = ""}
, 
[8258] = {Title = "Job Change to Ranger", 
Description = {"Teardrop is going to eat the Wing of Dragonfly. Continue your conversation with her."}
, Summary = "Continue your conversation with Instructor Teardrop."}
, 
[8259] = {Title = "Job Change to Ranger", 
Description = {"Take the 3 tests in the exam room and pass them to become a Ranger."}
, Summary = ""}
, 
[8260] = {Title = "Job Change to Ranger", 
Description = {"Navigate you way through the monsters and deliver the Letter to Caution. Be sure to use all 10 Bomb Ring Capsules before you reach Test Supervisor Caution."}
, Summary = ""}
, 
[8261] = {Title = "Job Change to Ranger", 
Description = {"The third test is on how effectively you can use a wolf. Control the wolf and dismantle all of the bombs that are summoned!"}
, Summary = ""}
, 
[8262] = {Title = "Job Change to Ranger", 
Description = {"You have finally passed all of the tests to become a Ranger."}
, Summary = "Speak to the Ranger Master to change your job."}
, 
[8265] = {Title = "Once per hour!", 
Description = {"Overplaying a game will be harmful! "}
, Summary = "You can\'t play with Yohean more than once in an hour."}
, 
[8266] = {Title = "Hunting Poison Spore", 
Description = {"Hunt 10 Poison Spores and then report to Sponiac at the Eden Group next to the 26-40 board. You can find the most Poison Spores at Mt. Mjolnir 6."}
, Summary = ""}
, 
[8267] = {Title = "Hunting Smokie", 
Description = {"Hunt 10 Smokies and then report to Sponiac at the Eden Group next to the 26-40 board. You can find the most Poison Spores at Mt. Mjolnir 6."}
, Summary = ""}
, 
[8268] = {Title = "Hunting Elder Willow", 
Description = {"Hunt 10 Elder Willows and then report to Sponiac at the Eden Group next to the 26-40 board. You can find Elder Willows in the fields East of Prontera and Payon."}
, Summary = ""}
, 
[8269] = {Title = "Hunting Coco", 
Description = {"Hunt 10 Coco and then report to Sponiac at the Eden Group next to the 26-40 board. You can find Cocos around Geffen Field 2."}
, Summary = ""}
, 
[8270] = {Title = "Hunting Thara Frog", 
Description = {"Hunt 10 Thara Frog and then report to Sponiac at the Eden Group next to the 26-40 board. You can find Thara Frogs in the dungeon east of Comodo."}
, Summary = ""}
, 
[8271] = {Title = "Toxic Insecticide", 
Description = {"Find Dieshin Man at the Morroc Ruins and deliver his Delivery Box to a Zoologist somewhere in Payon Field 7."}
, Summary = "Deliver the Insecticide"}
, 
[8272] = {Title = "Deliver some Honey!", 
Description = {"Find Dieshin Man at the Morroc Ruins and deliver his Delivery Box to an Entomologist somewhere in Prontera Field 3."}
, Summary = "Deliver the Honey"}
, 
[8273] = {Title = "Deliver a Blanket!", 
Description = {"Find Dieshin Man at the Morroc Ruins and bring his Delivery Box to a Biologist somewhere in Lutie Field."}
, Summary = "Deliver the Blanket"}
, 
[8274] = {Title = "Collect Bones", 
Description = {"Gather \'10 Skel-bones\'. The Skeletons in Payon Dungeon are the monsters that drop them."}
, Summary = "Deliver items to Dashia in Payon"}
, 
[8275] = {Title = "Collect Skins", 
Description = {"Collect \'10 Bear\'s Footskin\' and \'5 Animal Skin\'s. Bigfoot monsters drop them in Payon Field 7."}
, Summary = "Deliver items to Dashia in Payon"}
, 
[8276] = {Title = "Collect Peelings", 
Description = {"Collect \'20 Worm Peeling\'s and \'20 Garlet\'. You can gather these items in the Ant Hell dungeon at Fortress Saint Darmain (East)."}
, Summary = "Deliver items to Dashia in Payon"}
, 
[8277] = {Title = "Collect Tails!", 
Description = {"Collect \'10 Yoyo Tail\'s, \'10 Acorn\'s and \'10 Raccoon Leaf\'. You can get these items from Yoyos, Cocos, and Smokies in the eastern field of Ayothaya."}
, Summary = "Deliver items to Dashia in Payon"}
, 
[8278] = {Title = "Collect Cookies!", 
Description = {"Collect \'5 Well-baked Cookies and \'1 Piece of Cake\'. You can get these items from Cookies and Mystcases in the Toy Dungeon in Lutie."}
, Summary = "Deliver items to Dashia in Payon"}
, 
[8279] = {Title = "Collect a Moustache!", 
Description = {"Collect \'5 Mole Whiskers\' and \'3 Mole Claw\'s. You can get these items from Martins in the Mjolnir Dead Pit."}
, Summary = "Deliver items to Dashia in Payon"}
, 
[9000] = {Title = "Job Change to Knight", 
Description = {"The Chivalry Captain, \'Herman\', says you need to get approval from other Knights in order to become a Knight. "}
, Summary = "Talk to other members of Chivalry."}
, 
[9001] = {Title = "The Loyalty of a Knight", 
Description = {"5 of each: Elder Pixie\'s Moustache, Wing of Red Bat, Orcish Voucher, Moth Dust, Reptile Tongue and Mane"}
, Summary = "The first test from Sir Andrew!"}
, 
[9002] = {Title = "The Loyalty of a Knight", 
Description = {"5 of each: Heart of Mermaid, Maneater Blossom, Old Frying Pan and Snail\'s Shell"}
, Summary = "The first test from Sir Andrew!"}
, 
[9003] = {Title = "The Honor of a Knight", 
Description = {"Sir Andrew tells you to visit Sir Siracuse to continue the tests."}
, Summary = "Speak to Sir Siracuse"}
, 
[9004] = {Title = "The Honor of a Knight", 
Description = {"\'James Siracuse\' tells you to visit Sir Windsor to continue the tests."}
, Summary = "Speak to Sir Windsor"}
, 
[9005] = {Title = "The Tenacity of a Knight", 
Description = {"\'Sir Windsor\' only orders you to follow him...."}
, Summary = "Speak to Sir Windsor"}
