, 
[11160] = {Title = "John\'s Story", 
Description = {"Well...There\'s nothing... wrong...no worries..."}
, Summary = "Continue your conversation with John."}
, 
[11161] = {Title = "Tyler\'s Story", 
Description = {"If you aren\'t busy, could you scratch my back? It itches so much that I feel like I\'ve been bitten by an insect. I doubt there\'s a bug big enough to bite me on the back."}
, Summary = "Continue your conversation with Tyler."}
, 
[11162] = {Title = "Rose\'s Story", 
Description = {"Tell him there\'s no problem at all except that I\'m too good at my job."}
, Summary = "Continue your conversation with Rose."}
, 
[11163] = {Title = "Bain\'s Story", 
Description = {"Frede asked you to come? Just tell him I\'m doing well. Simple, isn\'t it?"}
, Summary = "Continue your conversation with Bain."}
, 
[11164] = {Title = "Lash\'s Story", 
Description = {"Well, if you wanna know about my current situation, can\'t you tell I\'m healthy with these arms seemingly firm as stone? Just tell them what you saw! Hahahahahahahh!"}
, Summary = "Continue your conversation with Lash."}
, 
[11165] = {Title = "Delivery to Brian", 
Description = {"After nagging Frede, I realized that I should look at myself. Hahaha. Tell Frede that I will go back to the village as soon as I recover."}
, Summary = "Delivery to Brian complete."}
, 
[11166] = {Title = "Delivery to John", 
Description = {"...... Thanks, mate..."}
, Summary = "Delivery to John Complete."}
, 
[11167] = {Title = "Delivery to Tyler", 
Description = {"Gosh!!! I had almost run out of Bradium! Thanks a lot!"}
, Summary = "Delivery to Tyler complete."}
, 
[11168] = {Title = "Delivery to Rose", 
Description = {"I\'ll go back to the village soon. We can meet up and hang out then!"}
, Summary = "Delivery to Rose complete."}
, 
[11169] = {Title = "Delivery to Bain", 
Description = {"Thanks very much! See you next time!"}
, Summary = "Delivery to Bain complete."}
, 
[11170] = {Title = "Delivery to Lash", 
Description = {"Ohhhhh!!!! What a big favor from you! My precious life might have ended here if you hadn\'t helped me!"}
, Summary = "Delivery to Lash complete."}
, 
[11171] = {Title = "Request from Frede", 
Description = {"Come here to sit and rest, eat this too."}
, Summary = "Speak to him again."}
, 
[11172] = {Title = "Request from Frede", 
Description = {"All my friends must be in the cave as I saw them coming to replenish Bradium. I hope they stay healthy. Would you visit them to check if they are okay?"}
, Summary = "Meet Friends of Frede: Brian, John, Tyler, Rose, Bain, and Lash."}
, 
[11173] = {Title = "Request from Frede", 
Description = {"I\'m really sorry that I\'m constantly asking you to do me favors, but would you deliver Bradium to my friends? If you ask Bouy at the building located northwest of the village, he will give you some refined Bradium. Please go get it."}
, Summary = "Meet Bouy and get refined Bradium."}
, 
[11174] = {Title = "Supply Shortage", 
Description = {"It takes a long time to refine a large chunk of mineral Bradium, but small pieces of Bradium will be quick. You can easily collect pieces of Bradium from monsters nearby. About 30 pieces of Bradium will be enough to share with 6 people."}
, Summary = "There is not enough Bradium. Collect 30 small pieces of Bradium."}
, 
[11175] = {Title = "Supply Shortage", 
Description = {"It\'s much faster to refine pieces of Bradium by hand instead of using a machine. I will only need an hour to finish. Please go rest while I get to work."}
, Summary = "The job seems like it\'ll take 2 hours to finish."}
, 
[11176] = {Title = "For my friends", 
Description = {"Job done! Bouy was a bit nervous because it\'s been a long time since he did manual work, but he did a good job. Please take these to the friends."}
, Summary = "Give the refined Bradium to the friends and go back to Frede to tell the story."}
, 
