, 
[11209] = {Title = "Mr. Tomas\' distress", 
Description = {"All the humans who visit Malangdo are coming to me, which is why I have too much work. There is a ^0000FFMalangdo regular meeting^000000, just go over there. <NAVI>[The place]<INFO>mal_in02,182,61,0,101,0</INFO></NAVI> is located on ^0000FFthe other side of the corridor at the end^000000."}
, Summary = "Participate in the meeting."}
, 
[11210] = {Title = "Malangdo regular meeting", 
Description = {"Today\'s agenda is ^ff99ccStar Candy^000000. If <NAVI>[anyone]<INFO>mal_in02,178,66,0,101,0</INFO></NAVI> has an opinion about the next topic, please speak up."}
, Summary = "Let\'s hear Scottfold\'s opinion."}
, 
[11211] = {Title = "Malangdo regular meeting", 
Description = {"There\'s ^0000FFInterpreter Biscuit^000000 next him, but it\'s really hard to have an in-depth conversation. Let\'s hear <NAVI>[Koon]<INFO>mal_in02,177,58,0,101,0</INFO></NAVI>\'s opinion."}
, Summary = "Let\'s hear Koon\'s opinion."}
, 
[11212] = {Title = "Malangdo regular meeting", 
Description = {"Let <NAVI>[me]<INFO>mal_in02,174,64,0,101,0</INFO></NAVI> tell you about the production of the study."}
, Summary = "Let\'s hear about Llinguist Devore\'s production of the study."}
, 
[11213] = {Title = "Malangdo regular meeting", 
Description = {"^0000FFStudy of the Starfish language^000000 started when we settled in Malangdo but it has not achieved what I expected. A simple conversation is available, but that\'s a poor performance. Let\'s hear about Geologist <NAVI>[Mali]<INFO>mal_in02,179,57,0,101,0</INFO></NAVI>\'s production of the study."}
, Summary = "Let\'s hear about Geologist Mali\'s production of the study."}
, 
[11214] = {Title = "Malangdo regular meeting", 
Description = {"There are several cracks in the ground. Nobody knows when the Star Candy will move, so we have to repair them quickly. Let\'s hear <NAVI>[Brie]<INFO>mal_in02,181,55,0,101,0</INFO></NAVI>\'s opinion."}
, Summary = "Let\'s hear Brie\'s opinion."}
, 
[11215] = {Title = "Malangdo regular meeting", 
Description = {"We pretty much understand that Mr. Rican\'s injury could affect the trading of Yggdrasilberry, so don\'t worry about that. Let\'s hear <NAVI>[Brie]<INFO>mal_in02,181,55,0,101,0</INFO></NAVI>\'s Story."}
, Summary = "Let\'s hear Brie\'s Story."}
, 
[11216] = {Title = "Yggdrasilberry", 
Description = {"Anyway, I don\'t know everything about Yggdrasilberry. If you have a question, just go to my home in ^6666ccWestern Malangdo^000000. <NAVI>[My father]<INFO>mal_in01,114,169,0,101,0</INFO></NAVI> will be bored out of his skull there..."}
, Summary = "Let\'s meet Brie\'s father Mr. Rican."}
, 
[11217] = {Title = "Yggdrasilberry", 
Description = {"^6666ccThe Yggdrasilberry is everywhere.^000000 You can get easily it on Malangdo island, so please bring about 30 of them to <NAVI>[me]<INFO>mal_in01,114,169,0,101,0</INFO></NAVI>."}
, Summary = "Let\'s bring 30 fresh Yggdrasilberry."}
, 
[11218] = {Title = "Yggdrasilberry", 
Description = {"Why don\'t you put the Yggdrasilberry in the <NAVI>[machine]<INFO>mal_in01,116,168,0,101,0</INFO></NAVI>?"}
, Summary = "Let\'s put the Yggdrasilberry in that machine."}
, 
[11219] = {Title = "Yggdrasilberry", 
Description = {"When you press the button, the machine starts. Let\'s talk with <NAVI>[Rican]<INFO>mal_in01,114,169,0,101,0</INFO></NAVI>."}
, Summary = "Let\'s talk with Rican."}
, 
[11220] = {Title = "Yggdrasilberry", 
Description = {"After getting a knee injury, I have to go to Dr. Mali everyday. If you see <NAVI>[my son]<INFO>mal_in02,181,55,0,101,0</INFO></NAVI>, just tell him to come back to me!"}
, Summary = "Let\'s find Brie."}
, 
[11221] = {Title = "The softest jelly in the world.", 
Description = {"If you need more details, please ask my  ^6666ccassistant <NAVI>[Bob]<INFO>mal_in02,140,94,0,101,0</INFO></NAVI>^000000. He might be ^6666ccright next door^000000."}
, Summary = "Let\'s meet Bob, the assistant."}
, 
[11222] = {Title = "The softest jelly in the world.", 
Description = {"Fill mixed gray and white clay into the crack. Close the gap with a stapler."}
, Summary = "Let\'s fix the crack with a repair kit. When everyone says okay..."}
, 
[11223] = {Title = "The softest jelly in the world.", 
Description = {"The crack is filled in as well. Let\'s report to <NAVI>[Bob]<INFO>mal_in02,140,94,0,101,0</INFO></NAVI>."}
, Summary = "Let\'s get back to Bob."}
, 
[11224] = {Title = "The softest jelly in the world.", 
Description = {"Impressive! Magical! Shocking! Well done!!! I\'ll tell <NAVI>[Dr. Mali]<INFO>mal_in02,179,57,0,101,0</INFO></NAVI>!"}
, Summary = "Let\'s see Dr. Mali."}
, 
[11225] = {Title = "Not intersecting effort of the road", 
Description = {"Everyone knows how <NAVI>[Dr. Devore]<INFO>mal_in02,174,64,0,101,0</INFO></NAVI> focuses his study on the starfish language!!! Please be confident! You are doing good!"}
, Summary = "Llinguist Devore might have fallen into a slump. Let\'s talk with him."}
, 
[11226] = {Title = "Not intersecting effort of the road", 
Description = {"The <NAVI>[starfish]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI> language is so mysterious. I don\'t know at all. I\'m not sure if it really is a \'language\' or not. I really want to know what they want over there!"}
, Summary = "Let\'s do some research on the starfish."}
, 
[11227] = {Title = "Not intersecting effort of the road", 
Description = {"Biscuit might have some very fluent language skills, unlike what Dr. Devore\'s says. I\'ll tell this fact to <NAVI>[Dr. Devore]<INFO>mal_in02,174,64,0,101,0</INFO></NAVI>."}
, Summary = "Let\'s go to Dr. Devore."}
, 
[11228] = {Title = "Not intersecting effort of the road", 
Description = {"That is incredible. Well, didn\'t it only speak in front of me? Let\'s go back to <NAVI>[Biscuit]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI> and hear it!!"}
, Summary = "Let\'s get back to Biscuit."}
, 
[11229] = {Title = "For the Star Candy", 
Description = {"You are able to speak with <NAVI>[Biscuit]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI> as the same species. Any conversation will help my study."}
, Summary = "Let\'s talk with Biscuit."}
, 
[11230] = {Title = "For the Star Candy", 
Description = {"I\'ve heard several things about Star Candy, <NAVI>[Biscuit]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI> and Malangdo."}
, Summary = "Continue the conversation."}
, 
[11231] = {Title = "For the Star Candy", 
Description = {"You just catch the jelly around here. Bring <NAVI>[me]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI> 30 delicious jellies. That will be enough for one meal."}
, Summary = "Let\'s get back with 30 delicious Jellies."}
, 
[11232] = {Title = "For the Star Candy", 
Description = {"<NAVI>[Biscuit]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI>: Hey Star Candy! You\'re clearly not enjoying that. Don\'t you have much of an appetite?"}
, Summary = "Let\'s find out what\'s going on."}
, 
[11233] = {Title = "For the Star Candy", 
Description = {"We have to carry water, so please bring a bucket and a brush to clean Star Candy. They might be in <NAVI>[storage]<INFO>mal_in02,102,94,0,101,0</INFO></NAVI>"}
, Summary = "Let\'s find a bucket and brush for cleaning."}
, 
[11234] = {Title = "For the Star Candy", 
Description = {"You brought stuff as well. Now you can rub your skin counterclockwise!"}
, Summary = "Clean up friable skin-> haggard skin-> cracked skin-> hard skin."}
, 
[11235] = {Title = "For the Star Candy", 
Description = {"Friable skin, haggard skin, cracked skin and hard skin becomes smooth, as soft as silk. Let\'s get back to <NAVI>[Biscuit]<INFO>mal_dun01,136,122,0,101,0</INFO></NAVI>."}
, Summary = "Let\'s get back to Biscuit."}
, 
[11236] = {Title = "Intersection", 
Description = {"You don\'t have to wait until the study is complete. Just tell <NAVI>[Devore]<INFO>mal_in02,174,64,0,101,0</INFO></NAVI>. I want to talk about the current situation with him."}
, Summary = "Let\'s send it to Dr. Devore."}
, 
[11237] = {Title = "Mr. Tomas\' distress", 
Description = {"Please send this good news to Chief <NAVI>[Tomas]<INFO>mal_in02,22,62,0,101,0</INFO></NAVI>."}
, Summary = "Let\'s see Chief Tomas."}
