, 
[11474] = {Title = "The Fast & The Old man", 
Description = {"Boxter looks extremely satisfied with the effectiveness of the potion and might have forgotten the purpose. Acquire ^0000ff25 Wings of Red Bat, 25 Claws of Rat, 25 Sweet Potatoes^000000 from the field located 11 o\' clock north of Payon and talk to Boxter again."}
