, Summary = "Maku."}
, 
[12002] = {Title = "Messenger of Friendship", 
Description = {"Become a messenger between Maku and Digotz for their abiding friendship."}
, Summary = "Go back and forth to deliver the messages."}
, 
[12003] = {Title = "Digotz\'s message", 
Description = {"Deliver Digotz\'s message to Maku \'\'-Hopeless Bastard! -You\'re still a stubborn jerk! -You owe me at least 3 lunches! -Not to mention an apology! -But who cares what you think?! -I\'m so goddamn happy without you!\'\'"}
, Summary = "Maku"}
, 
[12004] = {Title = "Maku\'s other friend", 
Description = {"After calming down, Maku says that his friend, Benkaistein, would always make sure that he stays out of fights. Maybe Digotz knows of this Benkaistein as well..."}
, Summary = "Digotz"}
, 
[12005] = {Title = "Benkaistein", 
Description = {"Digotz tells you that Benkaistein has an answer for the kind of situation that he and Maku are in. He\'s studying in a place with a lot of books..."}
, Summary = "Find Benkaistein\'s whereabouts"}
, 
[12006] = {Title = "Benkaistein\'s lost item", 
