, Summary = ""}
, 
[12036] = {Title = "The Stone Slate Message", 
Description = {"Now that you have found the last part of the slate, you should relay the message that you\'ve found to Boonthom."}
, Summary = "Shaman Boonthom"}
, 
[12037] = {Title = "Holier Threads", 
Description = {"Now you must bring back materials to Boonthom so that you can enter the 2nd underground level. Bring back 2 Holy Water, 1 Yggdrasil Leaf, 2 Fabric and 2 Nine Tails."}
, Summary = ""}
, 
[12038] = {Title = "Searching for the Sa-mhing Tiger", 
Description = {"You can enter the 2nd underground level of the dungeon. Search for traces of Boonthom\'s Comrade who may have found out something about the Sa-mhing Tiger."}
, Summary = ""}
, 
[12039] = {Title = "Boonthom\'s Comrade", 
Description = {"You should go back to Boonthom and tell him about his comrade."}
, Summary = "Shaman Boonthom"}
, 
[12040] = {Title = "Benkaistein\'s Journal", 
Description = {"Bring the journal to Digotz to remind him of all the good times they used to share together."}
, Summary = "Digotz"}
, 
[12041] = {Title = "Benkaistein\'s Journal", 
Description = {"Bring the journal to Maku to remind him of all the good times they used to share together."}
, Summary = "Maku"}
, 
[12042] = {Title = "Benkaistein\'s Journal", 
Description = {"You have delivered Benkaistein\'s Journal to Digotz and Maku... You should check how Digotz is doing and let him know that Maku has read the journal."}
, Summary = "Digotz"}
, 
[12043] = {Title = "Pass to the Slums", 
Description = {"Have a conversation with Benkaistein."}
, Summary = ""}
, 
[12044] = {Title = "Soothing a crying child 1", 
Description = {"Find Torpy\'s mother outside of the village."}
, Summary = "Finding Torpy\'s mother"}
, 
[12045] = {Title = "Soothing a crying child 2", 
Description = {"Deliver the mother\'s message to Torpy. [I\'ll be back??]"}
, Summary = "I\'ll be back??"}
, 
[12046] = {Title = "Soothing a crying child 3", 
Description = {"Find Torpy\'s father who caused all the trouble. He must be hiding somewhere in the village."}
, Summary = "Find the cause of the mess."}
, 
[12047] = {Title = "Soothing a crying child 4", 
Description = {"Bring [Steamed Crab Nippers] to the Strange Man. "}
, Summary = "Get the Steamed Crab Nippers"}
, 
[12048] = {Title = "Soothing a crying child 5", 
Description = {"Go tell Torpy and his mother about the ridiculous behavior of the strange man."}
, Summary = "Squeal on the strange man"}
, 
[12049] = {Title = "Job Quest 1 - Rogue", 
Description = {"Deliver the letter to Haijara Greg\'s youngest son, Louis Greg."}
, Summary = "Mail delivery1"}
, 
[12050] = {Title = "Job Quest 2 - Rogue", 
Description = {"Deliver the letter to Haijara Greg\'s 2nd son, Thor Greg. "}
, Summary = "Mail delivery2"}
, 
[12051] = {Title = "Job Quest 3 - Rogue", 
Description = {"Deliver the letter to Haijara Greg\'s first son, Jay Greg. "}
, Summary = "Mail delivery3"}
, 
[12052] = {Title = "Job Quest 4 - Rogue", 
Description = {"Deliver the letter to Haijara Greg\'s first son, Jay Greg."}
, Summary = "Mail delivery4"}
, 
[12053] = {Title = "Job Quest 5 - Rogue", 
Description = {"Thor Greg will initiate the secret Rogue skill for you. You must pass Thor Greg\'s test."}
, Summary = "Leaning the secret Rogue Skill"}
, 
[12054] = {Title = "Job Quest 6 - Rogue", 
Description = {"Return to Haijara Greg for more information."}
, Summary = "Listen to the details of skill"}
, 
[12055] = {Title = "Job Quest - Assassin", 
Description = {"Talk to Killtin to learn Venom Knife skill."}
, Summary = "Venom knife?"}
, 
[12056] = {Title = "Job Quest - Assassin", 
Description = {"Listen to Esmille carefully about learning Sonic Acceleration, and bring gemstones from certain places she mentions."}
, Summary = "Bringing the Gemstones"}
, 
[12057] = {Title = "Pass to the Lab", 
Description = {"Use the pass card to sneak into the lab."}
, Summary = "Use the pass"}
, 
[12058] = {Title = "Endless Tower Generate Condition", 
Description = {"Unable to create Endless Tower Dungeon"}
, Summary = "Reset at 4am after 7 days"}
, 
[12059] = {Title = "Orc\'s Memory Time Limit", 
Description = {"The time limit for access to the Orc\'s Memory is 2 hours. After the time expires, your instance dungeon will be destroyed."}
, Summary = "Admission restricted"}
, 
[12060] = {Title = "Today\'s Fishing Closed", 
Description = {"Gorurung won\'t accept any of your pieces of fish until a day has passed."}
, Summary = "Wait a day before turning in more fish."}
, 
[12061] = {Title = "Concentration", 
Description = {"Please be quiet at the fishing place."}
, Summary = "Behave!"}
, 
[12062] = {Title = "Today\'s Mining Closed", 
Description = {"No mining is allowed until 24 hours have passed."}
, Summary = "That\'s it for today!"}
, 
[12070] = {Title = "Limited time to enter", 
Description = {"You\'re only allowed to enter the endless tower with limited time."}
, Summary = "Limited time to enter the tower."}
, 
[12072] = {Title = "Thara Frog Hunting", 
Description = {"Have you seen a red frog? It is called Thara Frog and it\'s very rare. We are trying to verify where it inhabits. So please hunt 20 Thara Frogs in the dungeon east of Comodo. Talk to Rakkis at the Eden Group for your reward."}
, Summary = "Hunt 20 Thara Frogs"}
, 
[12073] = {Title = "Cruiser Hunting", 
Description = {"I\'ve heard of some toys attacking people. It\'s ridiculous! Let\'s show them our power! We have to hunt 15 Cruisers in the Toy Dungeon in Lutie. Talk to Rakkis at the Eden Group for your reward."}
, Summary = "Hunt 15 Cruisers"}
, 
[12074] = {Title = "Kukre Hunting", 
Description = {"Someone got robbed near the beach! The possible suspect is a criminal monster called Kukre. Please hunt 30 Kukre in Byalan Dungeon. Talk to Rakkis at the Eden Group for your reward."}
, Summary = "Hunt 30 Kukre"}
, 
[12075] = {Title = "Orc Baby Hunting", 
Description = {"Orc Babies are getting more violent these days. Please hunt 15 Orc Babies in the Orc Village in Geffen Field. Talk to Rakkis at the Eden Group for your reward."}
, Summary = "Hunt 15 Orc Babies"}
, 
[12076] = {Title = "Orc Warrior Hunting", 
Description = {"Orc Warriors are increasingly aggressive. Please hunt 20 Orc Warriors around the Orc Village in Geffen Field. Talk to Rakkis at the Eden Group for your reward."}
, Summary = "Hunt 20 Orc Warriors"}
, 
[12077] = {Title = "Vadon Hunting", 
Description = {"Have you seen crabs with thick shells? They are Vadons. Please hunt 15 Vadons in Byalan Dungeon. Talk to Rakkis at the Eden Group for your reward."}
, Summary = "Hunt 15 Vadon"}
, 
[12078] = {Title = "Megalodon Hunting", 
Description = {"Dead fish are all over the beach and it is getting worse. Please hunt 30 Megalodon in the dungeon east of Comodo."}
, Summary = "Hunt 30 Megalodon"}
, 
[12079] = {Title = "Marse Hunting", 
Description = {"Can you hunt Marse? I need 15 Marse for my study. Please help me! They are in Byalan Dungeon."}
, Summary = "Hunt 15 Marse"}
, 
[12080] = {Title = "Cornutus Hunting", 
Description = {"A stupid Cornutus bit the Mayor\'s foot. The Mayor is upset, so we need to hunt 20 Cornutus in Byalan Dungeon to make him happy!"}
, Summary = "Hunt 20 Cornutus"}
, 
[12081] = {Title = "Myst Hunting", 
Description = {"People are freaking out because of Myst. It looks like a ghost, so it scares people. Please hunt 15 Myst in the Mjolnir Dead Pit."}
, Summary = "Hunt 15 Myst"}
, 
[12082] = {Title = "Shellfish Hunting", 
Description = {"Don\'t ask why, but please hunt 30 Shellfish. It\'s a secret mission... you can find them 1 field south of Hugel or around Paros Lighthouse."}
, Summary = "Hunt 30 Shellfish"}
, 
[12083] = {Title = "Marine Sphere Hunting", 
Description = {"Marine Sphere? Do you know what a Marine Sphere is? I got a mission for you to hunt 15 Marine Sphere, so please do so in Byalan Dungeon"}
, Summary = "Hunt 15 Marine Sphere"}
, 
[12084] = {Title = "Phen Hunting", 
Description = {"The mayor wants to eat a delicious fish dish. Phen will be the perfect ingredient for it. Please hunt 20 Phen in Byalan Dungeon!"}
, Summary = "Hunt 20 Phen"}
, 
[12085] = {Title = "Orc Skeleton Hunting", 
Description = {"Dead Orc monsters returned to our town and they\'ve reincarnated as Orc Skeletons. We are in chaos! Please hunt 15 Orc Skeletons on the second floor of Orc Dungeon."}
, Summary = "Hunt 15 Orc Skeletons"}
, 
[12086] = {Title = "Zenorc Hunting", 
Description = {"Some weird monsters called Zenorc are attacking us. Please hunt 30 Zenorcs in Orc Dungeon."}
, Summary = "Hunt 30 Zenorc"}
, 
[12087] = {Title = "Mummy Hunting", 
Description = {"Be prepared! It\'s a cruel mission! Hunt 15 Mummies!! I tried once, but I couldn\'t succeed. It\'s too scary in the pyramid!"}
, Summary = "Hunt 15 Mummies"}
, 
[12088] = {Title = "41-55 Request", 
Description = {"You are on a quest from the 41~55 request board."}
, Summary = ""}
, 
[12090] = {Title = "Job Change to Royal Guard", 
Description = {"Heinrich tells you that he is looking for traces of Schmidt and any information about the Royal Guard."}
, Summary = "Continue the conversation with the middle-aged Gentleman, Heinrich"}
, 
[12091] = {Title = "Job Change to Royal Guard", 
Description = {"Prove your asceticism and endurance by bringing 100 Burning Hearts to Heinrich in Prontera Castle."}
, Summary = "Collect 100 Burning Hearts"}
, 
[12092] = {Title = "Job Change to Royal Guard", 
Description = {"You\'ve collected the 100 Burning Hearts. Continue your conversation with Heinrich and listen to his story."}
, Summary = ""}
, 
[12093] = {Title = "Job Change to Royal Guard", 
Description = {"The last trace should be somewhere in the Glast Heim St. Abbey. The research says that it should be in the main church area."}
, Summary = ""}
, 
[12094] = {Title = "Job Change to Royal Guard", 
Description = {"The inscription says: \'You are the one who has holy power... Find my memory near my old castle in Glast Heim. My chambers were to the north...\'"}
, Summary = ""}
, 
[12096] = {Title = "Job Change to Sorcerer", 
Description = {"Find Karacas on the 4th floor of Geffen Tower."}
, Summary = "Conversation with Karacas"}
, 
[12097] = {Title = "Job Change to Sorcerer", 
Description = {"Bring these materials to Karacas in Geffen Tower for the test to begin. 3 Wind of Verdure, 3 Crystal Blue, 3 Red Blood, and 3 Green Live."}
, Summary = ""}
, 
[12098] = {Title = "Tour of dungeon", 
Description = {"Bring the 4 different stones to these locations: 1st Floor of Ice Cave, 1st floor of Thor Volcano Dungeon, 3rd floor of Mjolnir Dead Pit, 2nd floor of Kunlun Dungeon and find the spirit detecting poles."}
, Summary = "If you get 3 different reagents, bring them back to Karacas in Geffen Tower."}
, 
[12099] = {Title = "Remove Root Cause", 
Description = {"Baby dragons near the Yggdrasilberry roots are reportedly hatching. Eliminating the baby dragons is important because they will eventually grow to be mean adults, so we have to take them out while they\'re young."}
, Summary = "Hunt 10 Draco\'s Eggs - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12100] = {Title = "Violent Winged Insect", 
Description = {"You\'ve received reports of sightings of a huge, unknown winged insect near the Laphine camp recently. We don\'t know how far the infestation of this insect may have spread, so please exterminate as many as you can find."}
, Summary = "Hunt 12 Luciola Vespas - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12101] = {Title = "Work Interference", 
Description = {"This just came in from colleagues working in the mine. The baby dragons living near Yggdrasilberry roots are destroying the grounds near the mines. It will get dangerous if we don\'t take care of it. Please wipe out the baby dragons near Yggdrasilberry."}
, Summary = "Hunt 5 Dracos - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12102] = {Title = "Intelligent Snakes", 
Description = {"A new race called Naga was found at the swamp near the Laphine camp. The problem is that they are primitive intellectuals and are violent. We will have many conflicts with them in the future if they expand their colony. Please eliminate the adult Nagas."}
, Summary = "Hunt 10 Nagas - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12103] = {Title = "Legendary Creature", 
Description = {"We get continuous reports of sightings of a legendary winged white horse near by the Laphine base. Can you go there and take a look? It could be a hallucination, so please make sure to touch it with your bare hand to make sure it is a living creature."}
, Summary = "Hunt 1 Cornus - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12104] = {Title = "Insects with an Appetite", 
Description = {"Centipede reproduction is another problem, but their appetite is also threatening our survival. They absorb Bradium minerals and damage our mining grounds. Many of our Sapha colleagues have lost their lives to the Centipedes. Please exterminate them."}
, Summary = "Hunt 15 Centipedes - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12105] = {Title = "Moving Rocks", 
Description = {"You get a report that raw Bradium minerals in the mines are alive. Looks like raw Bradium minerals have been turned into Golems by an ancient spell and now we may need to close down our mines because of them. Can you please go and eliminate them?"}
, Summary = "Hunt 10 Bradium Golems around Manuk Field 2 - Report to Hunting Dept. 1 Manager within 23 hours."}
, 
[12106] = {Title = "A child on a flower", 
Description = {"Our scout who went to Splendide is being attacked by cute, child-like monsters. So we inevitably need to hunt them, and you are the one to hunt them since you are not from Laphine."}
, Summary = "Hunt 15 Pinguiculas - Report to Hunting Dept. 2 Manager within 23 hours."}
, 
[12107] = {Title = "Twisted Love", 
Description = {"Are you aware of the child-like flower, Pinguicula? People say there has been a mutation of that flower. They are very violent and aggressive. Please go to check up on and treat it before they spread all over the area."}
, Summary = "Hunt 10 Dark Pinguicula in Nidhoggur Dungeon - Report to Hunting Dept. 2 Manager within 23 hours."}
, 
[12108] = {Title = "Dangerous Plant Removal", 
Description = {"Some mineral collectors are missing, and it seems that Nepenthes are responsible, for sure. Nepenthes is similar to Mandragora. We gotta do something in order to protect people from more damage."}
, Summary = "Hunt 12 Nepenthes - Report to Hunting Dept. 2 Manager within 23 hours."}
, 
[12109] = {Title = "Larva Extermination", 
Description = {"They\'ve discovered the centipede larva habitat. We can remove them now so there will be less centipedes. Would you find them and kill them? You will have to be careful with the centipedes around them."}
, Summary = "Hunt 14 Centipede Larvas - Report to Hunting Dept. 2 Manager within 23 hours."}
, 
[12110] = {Title = "Demon of Water", 
Description = {"Miners heading to Nidhoggur\'s nest reported being attacked by a strange water creature. It\'s said that it was a human-like water creature. Perhaps the Nidhoggur Dungeon is the origin, so please visit there and check it out."}
, Summary = "Hunt 7 Aqua Elementals - Report to Hunting Dept. 2 Manager within 23 hours."}
, 
[12111] = {Title = "Bird with an ugly face", 
Description = {"Tatachos were originally beautiful birds, and they could fly. But after they settled here where they have no natural enemies, they got fat and lazy. Eventually they became like now, such ugly birds. You will be a good natural enemy for them."}
, Summary = "Hunt 10 Tatachos - Report to Hunting Dept. 2 Manager within 23 hours."}
, 
[12117] = {Title = "Withered Flower", 
Description = {"This area was a wetland long ago. But for some reason the environment has changed over the years. There is a preservation near the Laphine camp. Can you bring me a Withered Flower specimen? It\'s to research environmental changes."}
, Summary = "Collect 6 Withered Flowers - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12118] = {Title = "Welcomed Mineral", 
Description = {"The Bradium refining machinery is broken and now we are short supplying refined Bradium to our colleagues working at the mine. So we are using all our adventurers to help collect refined Bradium. Please bring back 3 refined Bradiums from the Bradium Golem."}
, Summary = "Collect 3 Refined Bradium - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12119] = {Title = "Valuable Textile", 
Description = {"I have a request to bring in 16 Dragon\'s Manes. Dragon\'s Mane is only dropped in small volumes by the Dracos and is very valuable. It is used in the indigenous designs in our flags, clothes and field equipment."}
, Summary = "Collect 16 Dragon\'s Manes - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12120] = {Title = "Curious Meat", 
Description = {"This is a request from the pub for the food of people from other worlds. They want Dragon Tails to use as a cooking ingredient for field food that can be stored long-term. So humans like this. Please bring back 6 of them."}
, Summary = "Collect 6 Dragon Tails - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12121] = {Title = "Materials to Clear Snow", 
Description = {"The path that leads out of the city is now hazardously icy because of the snow we\'ve been getting. Spreading Pieces of Egg Shells will help, and we need a lot of them. Around 26 or so will do."}
, Summary = "Collect 26 Pieces of Egg Shells - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12122] = {Title = "Best Cooler Material", 
Description = {"The Bradium Processing Machinery emits tremendous heat when used and cannot be stabilized with any kind of water. So we mix Crystalized Teardrops obtained from Aqua Elementals from melted snow. We need them daily, so please bring back 6 of them."}
, Summary = "Collect 6 Crystalized Teardrops - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12123] = {Title = "Best Paint", 
Description = {"The Supply Manager has urgently requested paint to use on building maintenance throughout the city. He can make enough paint by using the Fluorescent Liquid obtained from Aqua Elementals. Please bring back 26 containers of it."}
, Summary = "Collect 26 Fluorescent Liquid - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12124] = {Title = "Rare Valuable", 
Description = {"The valuable interior water bottle in the minister\'s room is broken. They won\'t be able to find who did it because there are so many visitors every day. Can you please bring me this valuable item from an Aqua Elemental? I only need 1."}
, Summary = "Collect 1 Small Bottle - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12125] = {Title = "Armory Material", 
Description = {"Lining supplies for armor for the Guards are all out. The Naga scale shells are perfect lining material. Please bring back 18 of them."}
, Summary = "Collect 18 Scale Shells - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12126] = {Title = "Advanced Armory Material", 
Description = {"I got you a request named lining material for armor supplied to the guard commanders. They are different from ordinary lining. Please bring me 11 Naga shining scales. I don\'t think it will be much trouble for you."}
, Summary = "Collect 11 Shining Scales - Report to Supply Dept. 1 Manager within 23 hours."}
, 
[12127] = {Title = "Supervisor\'s Tool", 
Description = {"It\'s time to repair the trumpets for Mine supervisors. Because those trumpets are necessary to control the miners. The mystic horn of Cornus is the perfect trumpet material, please get 5 pieces of them."}
, Summary = "Collect 5 Mystic Horns - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12128] = {Title = "Preparation for Heating", 
Description = {"It seems that there isn\'t a sufficient amount of fur for the adventurers. It will be necessary to get some fur from Tatacho. 21 lumps will be enough."}
, Summary = "Collect 21 Fur - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12129] = {Title = "Suspicious Food", 
Description = {"There was a request from the pub to collect 27 bug legs. They don\'t wanna reveal the reason why they need them. Anyway, thank you."}
, Summary = "Collect 27 Bug Legs - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12130] = {Title = "Useful Material", 
Description = {"Zargon is very popular among the residents here. It\'s a beautiful, round-shaped ball and can be used as an adhesive when its powder is mixed with water. Would you get some? 26 Zargons will be enough."}
, Summary = "Collect 26 Zargon - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12131] = {Title = "Essential Material for Construction", 
Description = {"There is a request to find a material to be used for building repair work in every quarter. Please get 13 Solid Shells which can be obtained from Centipede and Centipede Larva. It will be very useful for the repair work."}
, Summary = "Collect 13 Solid Shells - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12132] = {Title = "Essential Material for Construction 2", 
Description = {"There is a request to find a material to be used for building repair work in every quarter. You need to get 16 Strong Vines which can be got from Nepenthes. It\'s a vital material for building repair work."}
, Summary = "Collect 16 Strong Vines - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12133] = {Title = "Decoration arrangement", 
Description = {"The guard needs many Sharp Leaves for decoration purposes. Some other adventurers have started searching for them. They need quite a few of the Sharp Leaves, so they want you to get 26 of them. I know it\'s hard. I wish you good luck!"}
, Summary = "Collect 26 Sharp Leaves - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12134] = {Title = "Instant Receptacle", 
Description = {"The pub owner is in trouble because of all the foreign adventurers. He wishes to have a utensil which can be used simply and instantly... Something like a wide leaf."}
, Summary = "Collect 11 Great Leaves - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12135] = {Title = "Not enough medicine", 
Description = {"There have been a couple of attacks at the mine. It must be those Nepenthes that were trying to attack miners. In order to make the medicine, we need 16 Brown Roots. Find and bring them."}
, Summary = "Collect 16 Brown Root - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12136] = {Title = "Honey robber", 
Description = {"The pub owner came by and complained about the big appetite you guys have. He said he has no more stock of honey and fruit. 2 jugs of honey will be enough to placate him."}
, Summary = "Collect 2 Honey - Report to Supply Dept. 2 Manager within 23 hours."}
, 
[12137] = {Title = "Tools for Experiment", 
Description = {"The industrial research center researches ways of refining Bradium efficiently but they are always short of test materials. I heard there is a merchant in the adventurer\'s city who sells Life Force Pots. I will need 4 of them."}
, Summary = "Collect 4 Life Force Pots - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12138] = {Title = "Fine Gift Samples", 
Description = {"The pub owner said he wants to give a gift to all his regular Sapha customers. But doesn\'t know what to give them. If you see any interesting gifts in Midgard, can you bring back 5 of them?"}
, Summary = "Collect 5 Bouquets - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12139] = {Title = "Respect for Taste!", 
Description = {"The High Minister is looking for the Midgard product, Witherless Roses, at the moment. Not sure if it\'s a good gift but... So... I know this is a difficult ask, but please bring me 1 Witherless Rose. This is just between you and me."}
, Summary = "Collect 1 Witherless Rose - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12140] = {Title = "Courtesy for Regulars", 
Description = {"A request from the pub owner. He says he can\'t use disposable leaf plates for regular customers. He is asking for 15 solid, white china plates from Midgard."}
, Summary = "Collect 15 Chinas - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12141] = {Title = "Special Package", 
Description = {"I have a personal request. I\'ve heard there is a round, transparent handicraft in Midgard. I think they are called Glass Beads. We have similar manufactured items here but nothing compared to the elaborate sphere there. Please get me 10 of them."}
, Summary = "Collect 10 Glass Beads - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12142] = {Title = "Dangerous Request", 
Description = {"Hmm... I don\'t know how to start. The High Minister is requesting puppets from Midgard. I don\'t know what they are, but since the High Minister is asking for them, they must be used for a very important purpose. Please bring 15 of them."}
, Summary = "Collect 15 Puppets - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12143] = {Title = "Strange Trend", 
Description = {"I\'ve heard there is a trend among many of my colleagues here involving a musical accessory made from a Bill of Birds from Midgard. I\'m thinking of distributing them within the Operations building. Can you buy and bring back 50 of them?"}
, Summary = "Collect 50 Bill of Birds - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12144] = {Title = "Unknown Usage", 
Description = {"The pub owner said he wanted to decorate the pub with something called Clam Shells. Please bring back about 50 of them. I have no idea how he will use them but I think he has a very unique taste after being acquainted with many adventurers."}
, Summary = "Collect 50 Clam Shells - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12145] = {Title = "Other World Cuisine", 
Description = {"We don\'t have cuisine for ourselves but many adventurers seem to enjoy the art of eating. So the pub owner needs a plate for his new cuisine. He\'s asked for 20 Crab Shells. I have no idea where you can get them, but... good luck."}
, Summary = "Collect 20 Crab Shells - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12146] = {Title = "Filling in Cracks", 
Description = {"I think the most useful Midgard item is Scells. Use Scells to fill in any crack or holes in a building and then mix and plaster ground Garlet onto it and the building is maintained quick and simple. Can you bring back 30 of them?"}
, Summary = "Collect 30 Scells - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12147] = {Title = "Adhesive Material", 
Description = {"Garlets are an element in building maintenance. They are one of the most important materials in buildings. Before Garlets were available, we crushed and used Zargons but they have become difficult to come by. Please bring back 40 of them."}
, Summary = "Collect 40 Garlets - Report to Transport Dept. 1 Manager within 23 hours."}
, 
[12148] = {Title = "Bait for Tatacho Hunting", 
Description = {"Those Tatachos are so quick; if we want to catch them it\'ll be pretty hard. So the Galtens here lure them with Monster\'s Feed. It\'s said that there is an expert who does that job, please get 100 Monster\'s Feed."}
, Summary = "Collect 100 Monster\'s Feed - Report to Transport Dept. 2 Manager within 23 hours."}
, 
[12149] = {Title = "Swordsmanship Practice", 
Description = {"The pub owner wants some apples to learn how to cook well. But I\'ve never heard of an adventurer from Midgard who was fond of his food. Anyway, he says that he will try, so get 100 apples for him."}
, Summary = "Collect 100 Apples - Report to Transport Dept. 2 Manager within 23 hours."}
, 
[12150] = {Title = "Pretty reddish vegetable", 
Description = {"This is a request from the pub owner. He wants some vegetables in order to prepare a colorful dish. Well... Carrot, is it? Anyway, that\'s what it\'s called in your land... I was just talking to myself before. Please bring 100 of them."}
, Summary = "Collect 100 Carrots - Report to Transport Dept. 2 Manager within 23 hours."}
, 
[12151] = {Title = "Tenacity of the pub owner", 
Description = {"It\'s said that there has been an explosion in the pub. People say it was because of a vegetable called Pumpkin being roasted on the fire. Bring 100 Pumpkins because they\'re all gone."}
, Summary = "Collect 100 Pumpkins - Report to Transport Dept. 2 Manager within 23 hours."}
, 
