[14118] = {Title = "Wuhari\'s concern", 
Description = {"Wuhari is worried about his brother in prison. Find a way into the prison and deliver Wuhari\'s heartfelt letter to his brother in jail."}
, Summary = ""}
, 
[14119] = {Title = "Test of patience", 
Description = {"The prisoner does not respond when talked to. He seems to test my patience."}
, Summary = "Talking with the prisoner."}
, 
[14120] = {Title = "Test of patience 2", 
Description = {"The prisoner still doesn\'t respond even after being talked to multiple times. Let\'s try again."}
, Summary = "Talking with the prisoner."}
, 
[14121] = {Title = "Test of patience 3", 
Description = {"The guy seems to keep his mouth shut no matter what. I wonder if there are any other ways."}
, Summary = "Talking with the prisoner."}
, 
[14122] = {Title = "Time for two", 
Description = {"Wuhari\'s letter was delivered to Wuhuru. He\'s asked for some time to read the letter. Don\'t bother him while he\'s reading the letter."}
, Summary = "Give him time to read the letter."}
, 
[14123] = {Title = "Wuhuru\'s favor", 
Description = {"After reading his brother\'s letter, Wuhuru begins to share his story extensively and asks you to send his brother his regards. Go back to Wuhari and give him his brother\'s regards."}
, Summary = "Sending Wuhari regards."}
, 
[14125] = {Title = "Surveying the area", 
Description = {"Wuhari is searching for ways to recover Wuhuru\'s body. However, he doesn\'t know how. Wouldn\'t people in the nearby areas know something? Survey the areas nearby."}
, Summary = "Talk with people in the town."}
, 
[14126] = {Title = "Searching for Ms. Goatie", 
Description = {"Mr. Masione said he doesn\'t know much at all. But he refers to Ms. Goatie who is a lot sharper with these things??"}
, Summary = "Search for Ms. Goatie."}
, 
[14127] = {Title = "Searching for Ms. Goatie\'s husband", 
Description = {"Ms. Goatie talks about how Wuhuru was very happy while shaking a piece of paper in the air. When asked about the paper, she says that her husband may know more about it."}
, Summary = "Search for Ms. Goatie\'s husband."}
, 
[14128] = {Title = "Obtaining the research report", 
Description = {"Mr. Svery, who was always close with Wuhuru, knows something more. The research report was inside the letter that Wuhuru left before being taken to prison. Take it to Wuhari."}
, Summary = "Delivering the report."}
, 
[14131] = {Title = "Analysis time", 
Description = {"Wuhari receives the report, but states that it will take some time to analyze it. Try talking to him a bit later. Don\'t bother someone when they are studying."}
, Summary = "Time for analysis."}
, 
[14133] = {Title = "Another favor", 
Description = {"Wuhari analyzes the research report, but he is still unsure about how to recover his brother\'s body. Try finding and asking the Laphine who originally requested Wuhuru\'s participation in the research."}
, Summary = "Obtaining the evidence."}
, 
[14134] = {Title = "Sharp Ms. Goatie", 
Description = {"Although Mr. Svery was visited for more insight, he says that he has no idea about the high-level Laphine. However, he suggests seeing his wife who\'s sharp with these things."}
, Summary = "To Ms. Goatie."}
, 
[14135] = {Title = "Searching for Mr. Pompe", 
Description = {"When asked about the high-level Laphine\'s whereabouts, Ms. Goatie does not know much. However, a neighbor in town, Mr. Pompe, shares that he saw a Laphine in the field who later disappeared. Let\'s ask Mr. Pompe for more details."}
, Summary = "Hearing the story from Mr. Pompe."}
, 
[14136] = {Title = "A terrible scene in the field", 
Description = {"Mr. Pompe is afraid of going out to the field. He talks about how a big corpse has been lying there ever since a high-level Laphine suffered a terrible death. Investigate the field."}
, Summary = "Field investigation."}
, 
[14137] = {Title = "An interesting proposition", 
Description = {"A Laphine girl has made an interesting proposition. It seems that the Laphine who gave Wuhuru the research report is the same person as her lost father. Let\'s look for him together."}
, Summary = "Field investigation."}
, 
[14138] = {Title = "The large corpse", 
Description = {"There is a large corpse that seems to have been there a while. He was the Laphine that everyone has been looking for. We have to let the girl know this bad news."}
, Summary = "Report to Giranni."}
, 
[14139] = {Title = "To Wuhuru", 
Description = {"The girl confirms that the corpse was her father. I have to go back to Wuhari empty-handed since the Laphine of interest has died. Before that, let\'s go to Wuhuru to tell him about the Laphine he had worked with."}
, Summary = "To Wuhuru."}
, 
[14140] = {Title = "To Wuhari", 
Description = {"Wuhuru shares all of his story, but it cannot be shared in its entirely with Wuhari. Go to Wuhari to at least tell him that the Laphine has died."}
, Summary = "Report to Wuhari."}
, 
