, Summary = "Lasda Midar"}
, 
[18030] = {Title = "Gaebolg Family Curse", 
Description = {"\"Oh, thank you so much! You don\'t understand how much I dread those Airships. Now, will you please deliver these books to ^ff0000Mr. Karlomoff^000000 near the Juno Library?\""}
, Summary = "Mr. Karlomoff"}
, 
[18031] = {Title = "Gaebolg Family Curse", 
Description = {"\"It would be of great help to me if you delivered this report to her right away. Ah, her name is Rodafrian. I\'m sure you can find her somewhere in that desert town.\""}
, Summary = "Rodafrian"}
, 
[18032] = {Title = "Gaebolg Family Curse", 
Description = {"Find Mondo in Mt. Mjolnir. Tell him your version of the story \"The great serpent swallowed the sea. The eagle of the rainbow swallowed the serpent. Then the eagle built its nest. A nest upon the swallowed sea.\""}
, Summary = "Mondo"}
, 
[18033] = {Title = "Gaebolg Family Curse", 
Description = {"\"Ahh, if you want to learn more, you should try to find the kid who was singing the song. Hmm, he might be around ^3131ddthe river near here^000000. Hopefully it won\'t be too hard to find him.\""}
, Summary = "Dazed Boy"}
, 
[18034] = {Title = "Gaebolg Family Curse", 
Description = {"Deliver the herbs given by the Exhausted-Looking Woman to Father Bamph in Prontera Church."}
, Summary = "Father Bamph"}
, 
[18035] = {Title = "Gaebolg Family Curse", 
Description = {"\"Please visit Bonnie Imbullea in Mount Mjolnir to see if you can find out more about that song, or about what happened after the attempted exorcism of the Jormungand curse.\""}
, Summary = "Bonnie Imbullea"}
, 
[18036] = {Title = "Gaebolg Family Curse", 
Description = {"Head back to Prontera Church and tell Father Bamph what you learned by speaking to Bonnie Imbullea."}
, Summary = "Father Bamph"}
, 
[18037] = {Title = "Gaebolg Family Curse", 
Description = {"\"Come with me, adventurer, to the secret ceremonial grounds of the royal family. Just use the switch hidden within the bookshelf and I will meet you there.\""}
, Summary = "Hidden switch"}
, 
[18038] = {Title = "Gaebolg Family Curse", 
Description = {"You examine the body of the king\'s first son, the crown prince. Examine the body of the second prince."}
, Summary = "Second prince"}
, 
[18039] = {Title = "Gaebolg Family Curse", 
Description = {"You examine the body of the king\'s second son. Examine the body of the third prince."}
, Summary = "Third prince"}
, 
[18040] = {Title = "Gaebolg Family Curse", 
Description = {"\"Brave adventurer, would you please visit the Assassin Guild in Morroc and see if you can learn how to verify whether poison was used to kill the princes?\""}
, Summary = "Assassin Guild"}
, 
[18041] = {Title = "Gaebolg Family Curse", 
Description = {"\"There is an Assassin\'s Private Pub in the 7 o\'clock direction in Morroc. Go find someone named ^3131ffMarjana^000000 inside.\""}
, Summary = "Marjana"}
, 
[18042] = {Title = "Gaebolg Family Curse", 
Description = {"\"Well, it\'s easier for me to visit Rodafrian now. She\'s much closer than Father Bamph, so I guess I\'ll go talk to her first.\""}
, Summary = "Rodafrian"}
, 
[18043] = {Title = "Gaebolg Family Curse", 
Description = {"\"Well, it\'s more urgent to go see Father Bamph and investigate the princes?bodies. I\'d better head over to Prontera right away.\""}
, Summary = "Father Bamph"}
, 
[18044] = {Title = "Gaebolg Family Curse", 
Description = {"\"Drat, she didn\'t give me any help... All I did was reveal a huge secret to her that she might broadcast indiscriminately! Oh well, I guess I\'d better head back to the priests...\""}
, Summary = "Prontera Church"}
, 
[18045] = {Title = "Gaebolg Family Curse", 
Description = {"\"Rodafrian seemed very happy and started reading through Karlomoff\'s report. For now, it would be best to return to Father Bamph.\""}
, Summary = "Father Bamph"}
, 
[18046] = {Title = "Gaebolg Family Curse", 
Description = {"\"Will you please bring 1 Yellow Gemstone and 1 Green Potion to the secret ceremonial grounds as soon as you can? I will wait over there for you once again.\""}
, Summary = "1 Yellow Gemstone and 1 Green Potion"}
, 
[18047] = {Title = "Gaebolg Family Curse", 
Description = {"The solution was effective in removing the scale marks from the princes. Report your findings to Father Bamph."}
, Summary = "Father Bamph"}
, 
[18048] = {Title = "Gaebolg Family Curse", 
Description = {"Father Bamph thanks you for helping them find out the truth. Speak to Father Biscuss and reveal your findings to him as well."}
, Summary = "Father Biscuss"}
, 
[18049] = {Title = "Gaebolg Family Curse", 
Description = {"Father Bamph thanks you for helping them find out the truth. Get back to Bonnie Imbullea and tell her that it was not her fault."}
, Summary = "Bonnie Imbullea"}
, 
[18050] = {Title = "Gaebolg Family Curse", 
