, 
[21004] = {Title = "Basic Potion Creation", 
Description = {"The healer wants me to dig up a red herb, which will be used as an ingredient for the potion. Go^4d4dffoutside Criatura\'s main gate^000000 and find ^4d4dffRed Plant^000000."}
, Summary = "Find Red Plant outside the main gate"}
, 
[21005] = {Title = "Save Location!", 
Description = {"I got a good one."}
, Summary = ""}
, 
[21006] = {Title = "Good News for Reno", 
Description = {"You should hand over the potion you received from the healer to Reno."}
, Summary = "Talk to Reno"}
, 
[21007] = {Title = "First Time Friend", 
Description = {"You got to know a good friend."}
, Summary = ""}
, 
[21008] = {Title = "The First Battle", 
Description = {"You were asked by the crew to catch the Poring that stole the materials used to repair the ship and bring back 2 Wood. Defeat the nearby Poring and retrieve the Wood."}
, Summary = "Deliver 2 Wood to the crew"}
, 
[21009] = {Title = "Sprakki\'s Call", 
Description = {"The guild has summoned you to take up an Eden Group Quest. Talk to <NAVI>[Sprakki]<INFO>iz_ac01,102,44,0,101,0</INFO></NAVI> in North Izlude\'s Criatura Academy."}
, Summary = "Talk to Sprakki"}
, 
[21011] = {Title = "All\'s Well that Ends Well", 
Description = {"You\'ve been asked by an old man in Payon to retrieve some liquor that has been kept in a well. Go to the well next to you and bring up the liquor bucket."}
, Summary = "Raise the bucket from the well."}
, 
[21012] = {Title = "Grandson\'s Whereabouts", 
Description = {"An old man has asked you to find his grandson, who has gone missing from the Archer Village in North Payon. Talk to the <NAVI>[guard in front of the cave]<INFO>pay_arche,41,133,0,101,0</INFO></NAVI> in the Archer Village."}
, Summary = "Talk to the cave guard"}
, 
[21013] = {Title = "Found One. Where\'s the Other?", 
Description = {"Reno, who also went looking for the grandson, is still in the cave. You were named specifically, so you have no choice but to go. Find <NAVI>[Reno]<INFO>pay_dun00,155,174,0,101,0</INFO></NAVI> inside the Payon cave."}
, Summary = "Speak to Reno inside the cave"}
, 
[21014] = {Title = "Smelly Slippery Zombies", 
Description = {"<NAVI>[Reno]<INFO>pay_dun00,155,174,0,101,0</INFO></NAVI>, who is terrified of zombies, asks you to defeat 5 zombies in the area."}
, Summary = "Defeat Zombies for Reno."}
, 
[21015] = {Title = "At War with the Undead", 
Description = {"With the surge in the number of zombies and skeletons, the Payon <NAVI>[Guard]<INFO>pay_arche,41,133,0,101,0</INFO></NAVI> has gone out of his mind. To bring down their numbers, defeat 10 zombies and 20 skeletons. The skeletons will appear once you go deeper into the cave."}
, Summary = "Defeat the Undead of Payon Cave"}
, 
[21016] = {Title = "At War with the Undead - Standby", 
Description = {"This is a daily quest, and you can re-attempt it when the cooldown resets. It can be obtained from the Eden Group mission board, or from the Payon Archer Village <NAVI>[Guard]<INFO>pay_arche,41,133,0,101,0</INFO></NAVI>."}
, Summary = "Resets at 4 am"}
, 
[21017] = {Title = "Soul Purification Ritual", 
Description = {"Amulets are required to purify the souls of the ghosts buried in the forgotten village. Defeat Munak and Bongun and collect their Amulets. Munak and Bongun appear in Payon Cave 3F."}
, Summary = "15 Amulets"}
, 
[21018] = {Title = "Soul Purification Ritual - Standby", 
Description = {"This is a daily quest, and you can re-attempt it when the cooldown resets. It can be obtained from the Eden Group mission board, or from the Payon Archer Village <NAVI>[Guard]<INFO>pay_arche,38,134,0,101,0</INFO></NAVI>."}
, Summary = "Resets at 4 am"}
, 
[21019] = {Title = "The Best Medicine", 
Description = {"An ascendant monk asks you to alleviate the Ghostfires with a clear alcoholic beverage and retrieve 10 Last Breaths. The clear alcoholic beverage can be collected from the Payon <NAVI>[Grandpa]<INFO>payon,192,109,0,101,0</INFO></NAVI>, and the Ghostfires appear in Payon Cave 4F Deserted Town."}
, Summary = "10 Last Breaths"}
, 
[21020] = {Title = "The Best Medicine - Standby", 
Description = {"This is a daily quest, and you can re-attempt it when the cooldown resets. It can be obtained from <NAVI><INFO>pay_dun02,134,123,0,101,0</INFO>[Wandering Monk]</NAVI> in Payon Dungeon 2F."}
, Summary = "Resets at 4 am"}
, 
[21021] = {Title = "Traces of Great Magic", 
Description = {"You are not sure of the reason, but the <NAVI>[Young Scholar]<INFO>payon,198,111,0,101,0</INFO></NAVI> needs 3 Girl\'s Handkerchiefs to find traces of magic. Girl\'s Handkerchiefs can be collected from Sohee in the Payon Cave Deserted Town."}
