, 
[21022] = {Title = "Traces of Great Magic - Standby", 
Description = {"This is a daily quest, and you can re-attempt it when the cooldown resets. It can be found with Payon\'s <NAVI><INFO>payon,198,111,0,101,0</INFO>[Young Scholar]</NAVI>."}
, Summary = "Resets at 4 am"}
, 
[21023] = {Title = "Fox Hunting", 
Description = {"The souls are bound to the Deserted Town because of the fox monster\'s Moonlight Flower. The elders of Payon have decided to defeat Nine Tails so as to weaken the Moonlight Flower.^4d4dffWith the Fox Orb^000000 you obtained from^4d4dffslaying the Nine Tails^000000, go to the <NAVI>[Elder in Front of the Buddha Statue]<INFO>pay_arche,139,33,0,101,0</INFO></NAVI>."}
, Summary = "Talk to the Elder in Front of the Buddha Statue after collecting the bead"}
, 
[21024] = {Title = "More Fox Hunting", 
Description = {"The Moonlight Flower of the Deserted Town is a dastardly thing that plays all kinds of tricks and shows no signs of leaving any time soon. Perhaps the Moonlight Flower is yet another lost soul, snatched away from this world too soon."}
, Summary = "Resets at 4 am"}
, 
[21025] = {Title = "Once Upon a Time...", 
