[21026] = {Title = "Waiting Worriedly for Wood", 
Description = {"The boy who went out to get firewood hasn\'t returned yet. It looks like <NAVI>[Dongdong]<INFO>pay_fild01,328,351,0,101,0</INFO></NAVI> went to the forest south of Payon to get firewood."}
