, 
[21027] = {Title = "They\'re Just Trees", 
Description = {"To get firewood, you must catch Willows and get Dry Wood, but Dongdong is too lazy to do that. Catch 3 Willows and get 2 Dry Wood for <NAVI>[Dongdong]<INFO>pay_fild01,328,351,0,101,0</INFO></NAVI>."}
, Summary = "2 Dry Wood"}
, 
[21028] = {Title = "Sweet, Sweet Labor", 
Description = {"You decide to go collect the firewood yourself. Catch 5 Willows in the forest north of Payon, get 3 Dry Wood, and bring them to the anxious <NAVI>[Middle-Aged Man]<INFO>payon,173,77,0,101,0</INFO></NAVI>."}
