[60721] = {Title = "Seal of Megingjard", 
Description = {"I should let Rebarev Doug know I\'m  ABOUT TO LEAVE, oh but before that I should make sure to find out more about the FINAL MISSION."}
, Summary = ""}
, 
[60722] = {Title = "Seal of Megingjard", 
Description = {"Not used"}
, Summary = ""}
, 
[60723] = {Title = "Seal of Megingjard", 
Description = {"Ask Librarian Jekan if he was able to find the 1st squad\'s final mission\'s paper work. He has bad eyesight and is in need of a Magnifier and a Lantern."}
, Summary = ""}
, 
[60724] = {Title = "Seal of Megingjard", 
Description = {"Librarian Jekan looks to be busy. Perhaps I should just \'read some documents\' for awhile and then check on the shelves until he figures out where on the shelves I should check for \'The 3rd Platoon Records\'."}
, Summary = ""}
, 
[60725] = {Title = "Seal of Megingjard", 
Description = {"Jekan will need some items to make a copy of the records. 2 Slick Paper and 1 Oil Paper from Amatsu, 3 Feather of Birds from Morroc, and 20 Blue Gems from Geffen."}
, Summary = "Take these items to Jekan to make him finish the copy faster."}
, 
[60726] = {Title = "Seal of Megingjard", 
Description = {"Your copy of the records has a strange search magic on it. To find specific info, you must first check for broad topic and then go more specific: crusader 3rd_company 3rd_platoon 1st_squad."}
, Summary = "Look up the individual members?names to find out where they are nowadays."}
, 
[60727] = {Title = "Seal of Megingjard", 
Description = {"Locate Zan Huadoku inside the Geffen Blacksmith guild. Maintain politeness when asking him how he is doing before you ask about their top secret final mission. Yeah, that\'s the ticket!"}
, Summary = ""}
, 
[60728] = {Title = "Seal of Megingjard", 
Description = {"Zan Huadoku has told you all that you think is possible. You should go to Morroc to track \'Cuaque Donon\' who was last seen at the Inn. You have a feeling that you may need to act stubbornly in Morroc."}
, Summary = ""}
, 
[60729] = {Title = "Seal of Megingjard", 
Description = {"Cuaque Donon is in a Rogue Guild hideout probably at \'Fortress Saint Darmain (South)\' [use map ctrl + ~] The password to enter has to be \'Aragham never hoarded upgrade items\'."}
, Summary = "Cuaque is suffering from extreme PTSD and \'freaks out\' so pretending that he is a young child might be of help, maybe even a dolly hahaha."}
, 
[60730] = {Title = "Seal of Megingjard", 
Description = {"Cuaque said the squad found the \'Megingjard\' and an argument broke out... You need to know more about that argument. Perhaps Jack.O in Alberta on the docks can be of help."}
, Summary = "He is still an active crusader, so I think talking to him would be much more straightforward."}
, 
[60731] = {Title = "Seal of Megingjard", 
Description = {"Jack.O found some relief from \'Green Herb\'s.  Perhaps I should pass that advice onto the other Crusaders when I meet them.  Emma Searth is in Aldebaran. A quick boat to Izlude and a Kafra warp to Aldebaran will have me there in a jiffy!"}
, Summary = "Maybe I should also consider a memory aid for these crusaders, something to help them remember their place like a \'Bookclip\' from a \'Rideword\'"}
, 
[60732] = {Title = "Seal of Megingjard", 
Description = {"I think I will have to rush up to see \'The Nineball.\' He works as a bouncer in the Jawaii Inn. I heard of an ex-barkeep of Jawaii working in the Central Prontera Pub, who might know a way to get to Jawaii without tying the knot!"}
, Summary = "Someone named Nineball, who is probably a bouncer, is a pretty closed mouth kinda guy... I should keep talking until he at least reacts to my questions..."}
, 
[60733] = {Title = "Seal of Megingjard", 
Description = {"Exit Jawaii with a Butterflywing or drink yourself back to Rune-Midgarts. Go to Comodo to see \'Royal Myst\' at the south casino. Morroc to Comodo is usually the easiest way to warp to Comodo."}
, Summary = "A \'couple\' of shots of \'Alcohol\' can loosen the Royal Myst\'s tongue..."}
, 
[60734] = {Title = "Seal of Megingjard", 
Description = {"You\'ve spoken to all the crusaders who are still alive, and you learn that apparently something happened and that blame was passed and Crusader Egnigem died in the process. You should get back to Prontera Castle and inform him of your findings."}
, Summary = "A Kafra hop from Comodo to Morroc to Prontera is quick unless you\'re saved in Prontera."}
, 
[60735] = {Title = "Seal of Megingjard", 
Description = {"You must talk to the last member of the 1st squad, the late Egnigem. A Kafra hop from Prontera to Morroc to Comodo on to Umbala and then a journey north to the Tree of Life to Nifflheim can take you to him."}
, Summary = "Listen to Egnigem and see what you can do to fix this."}
, 
[60736] = {Title = "Seal of Megingjard", 
Description = {"By Odin\'s mercy this is terrible... you never believed that a holy Crusader would do such an evil act to claim the power of Megingjard. Be brave and go back to the Crusader Headquarters and tell Max Von Shedough what you know."}
, Summary = ""}
, 
[60737] = {Title = "Seal of Megingjard", 
Description = {"Max Von Shedough has accepted my report, and is deeply disturbed by its contents, but part of me truly believes that despite good intentions the political reality may intervene to keep justice from being delivered."}
, Summary = "I must tell Egnigem at least of the outcome. He deserves to know at least what he died for.."}
, 
[60738] = {Title = "Seal of Megingjard", 
Description = {"Egnigem has blessed you with all his remaining strength. You have a feeling that he wants one special someone to know his fate. You must tell Emma Searth about his fate."}
, Summary = ""}
, 
[60739] = {Title = "Seal of Megingjard", 
Description = {"Emma can\'t remember, but she feels the loss. Your faith in Justice is weak now... You must tell Max Von Shedough that he is the Judge so he should share this burden of guilt."}
, Summary = "Return to Max Von Shedough at Prontera Castle."}
, 
